INSERT INTO `Answers` VALUES (217,'COMEDÓNICO','Se presenta con comedones y ocasionalmente con pequeñas pápulas y pústulas. No hay cicatrices.\nhttp://www.cenetec-difusion.com/CMGPC/SS-224-09/ER.pdf',23,NULL),(218,'QUÍSTICO','Numerosos comedones, pápulas y pústulas diseminadas en espalda, pecho, hombros. Quístes y nodulos ocasionales. Cicatrices moderadas.',23,NULL),(219,'VULGAR','Comedones y numerosas pápulas y pustulas principalmente en cara. Cicatrices leves.',23,NULL),(220,'CONGLOBATA','Numerosos quistes grandes en la cara, cuello y tronco superior. Cicatrices importantes.',23,NULL),(277,'ESTEROIDES TÓPICOS','Se recomienda esteroides tópicos en psoriasis leve y moderada. Se puede utilizar en combinación de ácido salicílico el cual mejora su efectividad.',24,NULL),(278,'INHBIDORES DE CALCINEURINA TÓPICOS','Actúan al bloquear la síntesis de numerosas citocinas que juegan un papel en la patogenia de psoariasis.',24,NULL),(279,'DERIVAR A DERMATOLOGÍA','Paciente adulto con psoriasis en placas se debe determinar la gravedad y posteriormente derivar a dermatología o reumatología (si incluye afectación articular). \nhttp://www.cenetec-difusion.com/CMGPC/IMSS-696-13/ER.pdf',24,NULL),(280,'CICLOSPORINA','La ciclosporina es altamente efectiva y de acción rápida para el tratamiento de psoriasis severa. Induce inmunosupresión al inhibir la fase activación de las células T.',24,NULL),(285,'ANALOGOS DE VITAMINA D','Los análogos de las vitamina D3 estan recomendados como terapia de inducción en pacientes con psoriasis leve o moderada.',25,NULL),(286,'METOTREXATE','Se recomienda como terapia de inducción en pacientes con psoriasis vulgar moderada o severa. Inhibe la proliferación de tejido linfoide y se cree que  tiene utilidad por este efecto.\nhttp://www.cenetec-difusion.com/CMGPC/IMSS-696-13/ER.pdf',25,NULL),(287,'CORTICOIDES TÓPICOS','Se recomienda esteroides tópicos en psoriasis leve y moderada. Se puede utilizar en combinación de ácido salicílico el cual mejora su efectividad.',25,NULL),(288,'PAVALIVIZUMAB','Es un anticuerpo monoclonal  utilizado para la prevención de la infección del virus sincitial respiratorio (VSR).',25,NULL),(289,'NEFROTOXICIDAD.','No es uno de los principales efectos adversos de la isotretinoína. Aminoglucósidos, litio, cisplatino y AINES se asocian con daño tubular renal. ',22,NULL),(290,'PROLOGACION DEL QT.','No es uno de los principales efectos adversos de la isotretinoína. Risperidona, macrólidos, antiarrítmicos, quinidinas, diuretico tiazídico, atidrepresivos tricíclicos pueden prolongar el segmento QT en electrocardiograma.',22,NULL),(291,'ANEMIA HEMOLÍTICA.','No es uno de los principales efectos adversos de  la isotretinoína. Cefalosporinas, levodopa, levofloxacina aumentan el riesgo de anemia hemolítica. ',22,NULL),(292,'FOTOSENSIBILIDAD.','La isotreinoína es el estándar de oro en el tratamiento de acné grave y puede utilzarse en acné moderado o resistente la tratamiento. Los efectos secundarios son teratogenicidad, hepatoxicidad, fotosensibilidad, sequedad de la piel,cefalea e incremento de lípidos sanguineos. http://www.cenetec-difusion.com/CMGPC/SS-224-09/ER.pdf',22,NULL),(317,'PENFIGOIDE AMPOLLOSO','Las lesiones típicas son ampollas tensas y grandes, las\ncuales tienen predilección por las extremidades (cara\ninterna de muslos y áreas flexurales de brazos y piernas),área inguinal, axilas, abdomen y cuello. Signo de Nikolsky negativo. Los estudios de inmunofluorescencia\n(IF) directa de piel perilesional muestran depósitos lineales de IgG y/o C3 en la zona de la membrana basal (ZMB).',26,NULL),(318,'PSORIASIS','Se caracteriza por placas eritematosas en la piel cubiertas con escamas gruesas y plateadas.',26,NULL),(319,'LIQUEN PLANO','Se caracteriza por \"Las 5 P`s\": Pápulas y Placas (no ampollas), Poligonales, Pruríginosas, Purpúricas Los sitios más comúnmente afectados son la muñeca y los tobillos. ',26,NULL),(320,'PEMFIGO VULGAR','Es una enfermedad crónica autoinmune, de baja prevalencia y potencialmente fatal. Se suele encontrar anticuerpos antidesmogleina 1 y 3 (antiDsg). Las lesiones suelen comenzar a nivel oral y el signo de Nikolsky positivo es característico. http://www.cenetec-difusion.com/CMGPC/IMSS-593-13/ER.pdf',26,NULL),(329,'PENFIGOIDE AMPOLLOSO','Se caracteriza por la presencia de ampollas tensas asentadas en piel\nnormal o eritematosa que tienen predilección por las extremidades y frecuentemente la enfermedad tiende a generalizarse. En el\nestudio histológico se observa una ampolla subepidérmica, con predominio de eosinófilos. Los estudios de inmunofluorescencia\n(IF) directa de piel perilesional muestran depósitos lineales de IgG\ny/o C3 en la zona de la membrana basal (ZMB).',27,NULL),(330,'INFECCIÓN POR HERPES','El herpes labial es una enfermedad contagiosa causada por el virus herpes simplex tipo 1 (HSV-1). El paciente infectado con el virus herpes simple tipo 1 en general presenta heridas dolorosas en los labios, pero la infección también puede afectar a las encías, la faringe, la lengua, el paladar,  la parte interna de las mejillas y, algunas veces, el cuello y la cara.',27,NULL),(331,'SINDROME DE PIEL ESCALDADA','El síndrome de la piel escaldada estafilocócica es una enfermedad caracterizada por la formación de ampollas rojas en la piel que parece una quemadura o escaldadura, de ahí su nombre síndrome de escaldadura estafilocócica de la piel. Es causado por la liberación de dos exotoxinas (toxinas epidermolíticas A y B) de cepas toxigénicas de la bacteria Staphylococcus aureus.',27,NULL),(332,'IMPÉTIGO','El impétigo es una enfermedad infecciosa superficial de la piel producida por bacterias (s. aureus o s. pyogenes), que se presenta con mayor frecuencia en los niños. Pueden presentar como complicación una glomerulonefritis posestreptocócica.\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/588_GPC_Exantemasinfecciososenlainfancia/588GER.pdf',27,NULL),(337,'ITRACONAZOL','Es la segunda opción para el tratamiento de tiña corporis. Inhiben la síntesis de ergosterol.',28,NULL),(338,'TERBINAFINA','Es la primera elección en tiña corporis y cruris (en crema). Inhibe la ezima esqualeno epoxidasa.\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/086_GPC_Tinayonicomicosis1NA/Tina_R_CENETEC.pdf',28,NULL),(339,'CEFTRIAXONA','Es una cefalosporina  de tercera generación. De amplio espectro. Primordialmente es usada en meningitis bacteriana y gonorrea.',28,NULL),(340,'DOXICICLINA','Antibíotico de amplio espectro. Está indicada para el tratamiento de  enfermedad de lyme, fiebre tifus, fiebre Q, erupciones pustulosas por ricketsias y fiebre de las montañas rocosas por ricketsias, infecciones del tracto respiratorio causadas por Mycoplas­ma pneumoniae.',28,NULL),(357,'NECRÓLISIS EPIDÉRMICA TÓXICA.','Es una enfermedad cutánea grave con aparición de flictena, lesiones exfoliativas de la piel (generalmente dolorosas) y mucosas. Cubriendo una superficie mayor al 30% de la superficie corporal. Por lo general es secundario a tratamiento con aminopenicilinas, sulfonamidas, fluoroquinolonas, antiepilépticos.\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/398_GPC_Diagnostico_tratamiento_SINDROME_STEVENS_JOHNSON/GER_STEVENS_JONSON.pdf',29,NULL),(358,'SÍNDROME DE STEVENS JOHNSON.',' Es una enfermedad cutánea grave con aparición de flictena, lesiones exfoliativas de la piel (generalmente dolorosas) y mucosas. Stevens Johnson es cuando hay afectación menor del 10% de la superficie corporal. Superposición es cuando es del 10 al 30%. Por lo general es secundario a tratamiento con aminopenicilinas, sulfonamidas, fluoroquinolonas, antiepilépticos.',29,NULL),(359,'ERITEMA MULFORME.','El eritema multiforme  o eritema polimorfo es una enfermedad aguda de la piel y/o de las mucosas de\nnaturaleza inmunológica, que puede comportarse como crónica recurrente,\ny que se caracteriza por presentar lesiones\ncutáneas eritemato-bullosas de varios tipos y/o lesiones mucosas pluriorificiales\nde tipo vesículo-ampollar.\nEn cuanto a la clínica, clásicamente se\ndistingue entre una forma menor o recurrente y las formas mayores que\nincluyen el síndrome de Stevens-Johnson (SSJ) y el síndrome de Lyell o necrólisis epidérmica tóxica.',29,NULL),(360,'PÉNFIGO VULGAR.','s una enfermedad crónica autoinmune, de baja prevalencia y potencialmente fatal. Se suele encontrar anticuerpos antidesmogleina 1 y 3 (antiDsg). Las lesiones suelen comenzar a nivel oral y el signo de Nikolsky positivo es característico. ',29,NULL),(369,'METROTEXATE','Es un fármaco análogo al ácido fólico usado en el tratamiento del cáncer y de enfermedades autoinmunes como la artritis reumatoide y la psoriasis.',30,NULL),(370,'INMUNOGLOBULINA INTRAVENOSA','Se indica en el tratamiento de Stevens Johnson y necrólisis epidérmica tóxica, dentro de las primeras 48 a 72 horas de las erupciones de las ampollas.',30,NULL),(371,'DANTROLENO','Es usado en el tratamiento de hipertermia maligna. Actua sobre el receptor de rianodina atenuando la elevación de calcio intracelular.',30,NULL),(372,'VITAMINA K ','Es utilizada para dismunir el efecto de la warfarina.',30,NULL),(377,'CICLOSPORINA','La ciclosporina es un inhibidor de calcineurina efectivo en\nel tratamiento de la Dermatitis Atópica refractaria al tratamiento\nconvencional.',31,NULL),(378,'SIROLIMUS','Es un medicamento inmunosupresor usado para evitar el rechazo de órganos trasplantados; se usa especialmente en el trasplante de riñón.',31,NULL),(379,'INFLIXIMAB','Disminuye el efecto del factor de necrosis tumoral y apoptosis. Se usa principalmente en artritis reumatoide, las espondiloartropatías, la artritis psoriásica, la enfermedad de Crohn, la colitis ulcerosa ,la psoriasis u la sarcoidosis.',31,NULL),(380,'ETANERCEPT','Se une de forma específica al factor de necrosis tumoral. Es usado primordialmente para tratar  artritis reumatoide, artritis reumatoidea juvenil, artritis psoriasica y espondiloartropatías.',31,NULL),(385,'HIPERSENSIBILIDAD TIPO 1','Antígeno reticula a la IgE en los mastocitos presensibilizados y basófilos, lo que desencadena la liberación de aminas vasoactivas como\nhistamina. Se presenta en anafilaxia (picadura de abeja, alergia a la comida), asma, urticaria, reacciones a los medicamentos urticariales.\n',32,NULL),(386,'HIPERSENSIBILIDAD TIPO 2','IgM e IgG se unen al antígeno en a la célula \"enemiga\", que conduce a la lisis por complemento o fagocitosis.\nSe presenta en anemia hemolítica autoinmune, eritroblastosis\nfetalis, síndrome de Goodpasture,\nfiebre reumática.',32,NULL),(387,'HIPERSENSIBILIDAD TIPO 3','Complejos antigeno-anticuerpo activan el complemento, el cual atrae polimorfonucleares. Se presenta en poliarteritis nodosa,\nglomerulonefritis compleja autoinmune,\nLES, artritis reumatoide.',32,NULL),(388,'HIPERSENSIBILIDAD TIPO 4','Hipersensibilidad retardada, es mediada por células, no anticuerpos. Incluye pruebas cutáneas de tuberculosis, rechazo de trasplante  y dermatitis por contacto. En México la dermatitis por contacto presenta una frecuencia en la consulta dermatológica entre el 4% al 7%.\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/560_GPC_Dermatitisporcontacto/GER_DermatitisContacto.pdf',32,NULL),(393,'ESTEROIDES TÓPICOS','El uso de esteroides tópicos es de utilidad para el tratamiento de dermatitis atopica irritativa.',33,NULL),(394,'DERIVAR A DERMATOLOGÍA','El médico familiar debe establecer el diagnóstico y dar tratamiento. En los casos de duda diagnostica, recurrencia o refractariedad debe derivarse  al servicio de dermatología.\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/560_GPC_Dermatitisporcontacto/GER_DermatitisContacto.pdf',33,NULL),(395,'ESTEROIDES SISTÉMICOS','Se recomienda el uso de esteroides sistémicos en el uso de dermatitis atópica severa, en especial la prednisona. ',33,NULL),(396,'CICLOPORINA','No hay suficiente evidencia para  su uso en el tratamiento de dermatitis atópica.',33,NULL),(461,'CARDIOVERSIÓN','La cardioversión con corriente directa se basa en la\nadministración de un choque eléctrico sincronizado con la\nactividad intrínseca, usualmente por sensado de la onda R del ECG. Esta técnica asegura que la estimulación eléctrica\nno ocurra durante el periodo vulnerable del ciclo cardiaco,\nque va de 80 a 60 ms antes y de 20 a 30 ms después del\npico de la onda T. La cardioversión eléctrica es usada para normalizar todos los ritmos cardiacos anormales, excepto la fibrilación ventricular. Es indicada cuando es inestable la arritmia o no hay mejora con el tratamiento farmacológico.',37,NULL),(462,'ESMOLOL + HEPARINA','Los anticoagulantes indicados en fibrilación auricular son la aspirina, clopidrogrel o acenocumarina.',37,NULL),(463,'AMIODARONA + ASPIRINA','La amiodarona y digoxina estan indicadas cuando hay insuficiencia cardiaca, disfuncion ventricular o sedentarismo.',37,NULL),(464,'METOPROLOL + CUMARINICOS','Tratamiento farmacológico de la FA: antiarrítmicos clase I; clase Ic, FAA Clase III, beta-bloqueadores. \nLos anticoagulantes indicados en fibrilación auricular son la aspirina, clopidrogrel o acenocumarina.\nLa escala de CHADS proporciona un puntaje\nque permite evaluar el riesgo de enfermedad\nvascular cerebral isquémica en pacientes con\nfibrilación auricular, de acuerdo con la\nsiguiente clasificación.\nC: Insuficiencia cardiaca congestiva.\nH: Hipertensión arterial.\nA: Edad mayor de 75 años.\nD: Diabetes mellitus.\nS: EVC previo o isquemia cerebral\ntransitoria.\nLa presencia de cada factor agrega un punto a\nla escala.\n Puntaje 0: riesgo bajo. Podría usarse aspirina.\nPuntaje 1: riesgo moderado. Usar aspirina o cumarínicos como anticoagulantes.\nPuntaje 2 o más: riesgo moderado/alto. Usar siempre cumarínicos.\nhttp://www.cenetec-difusion.com/CMGPC/S-014-08/ER.pdf',37,NULL),(469,'VALVULA TRICÚSPIDE','Aunque los focos ectópicos de la aurícula izquierda y derecha pueden causar fibrilación auricular, los focos ectópicos en las venas pulmonares son los más comunes. Es de destacar que el anillo tricúspide es el sitio más común para el flutter auricular.',38,NULL),(470,'VENAS PULMONARES','Su paciente tiene fibrilación auricular de nueva aparición; en la fibrilación auricular, el sitio de origen más probable para los focos ectópicos son las venas pulmonares.',38,NULL),(471,'VALVULA MITRAL','Aunque los focos ectópicos de la aurícula izquierda y derecha pueden causar fibrilación auricular, los focos ectópicos en las venas pulmonares son los más comunes. Es de destacar que el anillo tricúspide es el sitio más común para el flutter auricular.',38,NULL),(472,'VENTRÍCULO DERECHO','La fibrilación auricular es una taquicardia supraventricular y, por definición, no puede originarse en el ventrículo.',38,NULL),(485,'DISMINUCIÓN DE SEBO.','Acné se relaciona con un aumento de la producción de sebo.',21,NULL),(486,'RETENCIÓN DE QUERATINA.','Acné es una enfermedad inflamatoria de la piel que se caracteriza por comedones abiertos y cerrados, y lesiones inflamatorias entre las que se influyen pápulas, pústulas, abscesos y nódulos.\nAparece en la adolescencia al iniciar la producción de andrógenos por las gónadas. Acné afecta la unidad pilosebacea mediante cuatro mecanismos: 1) Retención de queratina 2)Producción incrementada de sebo 3) Sobreinfección por Propionibacterium Acnes 4) Inflamación.\nhttp://www.cenetec-difusion.com/CMGPC/SS-224-09/ER.pdf',21,NULL),(487,'SOBREINFECCION CON S. AUREUS','Acné se asocia con sobreinfección por Propionibacterium Acnes.',21,NULL),(488,'FOLICULITIS','Foliculitis es la inflamación de uno o mas foliculos pilosos. El agente causal mayormente asociado es staphylococcus aureus.',21,NULL),(525,'AMIODARONA','. Este\nfármaco es modestamente efectivo para la cardioversión\nfarmacológica en FA de reciente inicio, pero actúa\nmenos rápidamente y probablemente con menor\neficacia que otros agentes. El índice de conversión en\npacientes con FA de más de siete días de duración es\nlimitado. Sin embargo, la restauración del ritmo puede\nno ocurrir durante días o semanas. La amiodarona\ntambién es efectiva en el control de la frecuencia\nventricular en respuesta a la FA.',40,NULL),(526,'PROPANOLOL+ ASPIRINA','Los beta bloqueadores y los calcio antagonistas pueden administrase cuando no hay datos de inestabilidad hemodinámica.',40,NULL),(527,'CARDIOVERSIÓN','Si el paciente presenta \nDolor precordial.\n• Dificultad para respirar.\n• Hipotensión arterial.\n• Alteración del estado de conciencia.\n• Choque clínico.\nSi el paciente presenta cualquiera de estos\nsíntomas o signos y son debidos a la\ntaquicardia entonces la fibrilación auricular\nestá ocasionando inestabilidad\nhemodinámica. Es urgente la cardioversión\neléctrica inmediata.\nhttp://www.cenetec-difusion.com/CMGPC/S-014-08/RR.pdf',40,NULL),(528,'REPETIR ECG Y ADMINISTRAR ASPIRINA','Presenta datos claros de inestabilidad hemodinámica por lo que la cardioversión es el mejor tratamiento.',40,NULL),(529,'EMBOLECTOMÍA','Los pacientes con fibrilación auricular tienen riesgo de complicaciones embólicas, especialmente los pacientes que suspenden abruptamente su anticoagulación. Las complicaciones embólicas pueden incluir apoplejía u otras embolizaciones sistémicas. Una embolia en la arteria ilíaca común da como resultado una pierna pálida, sin pulso y dolorosa, y requiere una embolectomía inmediata para preservar la extremidad. Las complicaciones posteriores a la embolectomía incluyen el síndrome compartimental que puede requerir una intervención quirúrgica adicional (por ejemplo, fasciotomía).\nhttp://www.cenetec-difusion.com/CMGPC/S-014-08/ER.pdf',39,NULL),(530,'TROMBOLISIS','\nLa trombolisis sería apropiada para un paciente con un accidente cerebrovascular isquémico.',39,NULL),(531,'FASCIOTOMIA','Las complicaciones posteriores a la embolectomía incluyen el síndrome compartimental que puede requerir una intervención quirúrgica adicional (por ejemplo, fasciotomía).',39,NULL),(532,'ANTICOAGULANTE VIA ORAL.','Medidas disponibles para la reducción del reducción del\nriesgo tromboembólico previo al evento embólico)\n• Acenocumarina.\n• Ácido acetil salicílico o clopidogrel.\n• Extirpación o aislamiento de la orejuela\nizquierda.',39,NULL),(537,'BNP','Se usa para descartar otras causas de disnea. En pacientes con insuficiencia cardiaca, las concentraciones plasmáticas circulantes de ANP, BNP y los fragmentos terminales de sus prohormonas (NT-proANP y NT-proBNP) están elevadas, debido a que el sistema hormonal cardiaco se activa al incrementarse el estiramiento de la pared.',44,NULL),(538,'PCR','La PCR es producida por el hígado y por las células grasas (adipocitos). Se trata de un miembro de la clase de reactantes de fase aguda que aumentan los niveles de manera espectacular durante los procesos inflamatorios que ocurren en el cuerpo.',44,NULL),(539,'PT ','El tiempo de protrombina e INR (siglas en inglés de International Normalized Ratio) son pruebas de laboratorio que evalúan específicamente la vía extrínseca de la coagulación sanguínea.',44,NULL),(540,'TIEMPO DE SANGRADO','El tiempo de sangrado mide la interacción de las plaquetas con la pared de los vasos sanguíneos y la subsecuente formación del coagulo. Por lo tanto, el tiempo de sangrado mide las etapas tempranas de la hemostasia: la fase vascular y la plaquetaria.',44,NULL),(557,'ESTENOSIS DE LA VÁLVULA MITRAL','En la estenosis mitral, el flujo sanguíneo está reducido a través de la válvula con una abertura estrecha. Como resultado, el volumen y la presión de la sangre en la aurícula izquierda aumentan, y la aurícula se agranda. La aurícula izquierda aumentada de tamaño suele latir rápidamente y siguiendo un patrón irregular (fibrilación auricular). Como resultado, la eficacia del bombeo del corazón se reduce, dado que la aurícula en fibrilación tiembla en lugar de bombear. En consecuencia, la sangre no fluye con rapidez a través de la aurícula y pueden formarse coágulos de sangre dentro de esa cámara. Si un coágulo se libera (convirtiéndose en un émbolo), es bombeado fuera del corazón y puede obstruir una arteria, lo que podría producir un accidente cerebrovascular u otros daños.',46,NULL),(558,'REGURGITACIÓN DE LA VÁLVULA AORTICA','La insuficiencia aórtica  consiste en el reflujo de sangre desde la aorta hacia el ventrículo izquierdo durante la diástole.',46,NULL),(559,'MIXOMA DE LA AURICULA IZQUIERDA','Esta paciente tiene un mixoma auricular izquierdo basado en sus síntomas y un soplo compatible con estenosis de la válvula mitral. Con presencia de pérdida de peso. Además, tiene un clásico sonido en el examen que se produce cuando el tumor entra y sale del tracto de entrada de la válvula mitral. Los síntomas pueden incluir platipnea. El tratamiento es una escisión quirúrgica.\nhttp://www.cenetec-difusion.com/CMGPC/IMSS-397-10/ER.pdf',46,NULL),(560,'ESTENOSIS DE LA VÁVULA TRICUSPIDEA','La estenosis tricuspídea está generalmente relacionada con la fiebre reumática. A menudo, las personas que tienen una estenosis tricuspídea también tienen una estenosis mitral. Casi nunca se nace con estenosis tricuspídea y no es hereditaria.',46,NULL),(561,'ATENOLOL','Atenolol es un betabloqueador contraindicado en el uso de isuficiencia cardiaca.',45,NULL),(562,'FUROSEMIDA','Su paciente está sufriendo un episodio de insuficiencia cardíaca descompensada aguda. Los antecedentes de miocardiopatía isquémica y falla cardíaca del paciente junto con un nivel de troponina negativo apuntan a este diagnóstico. Este paciente está sobrecargado de volumen y necesita un diurético para disminuir la precarga de su corazón. La furosemida, un diurético de asa, disminuirá la precarga y es la mejor opción.',45,NULL),(563,'ENALAPRIL','Están indicados los IECAS+ Beta bloqueadores para disminuir el riesgo de hospitalización por IC o mortalidad prematura.',45,NULL),(564,'METOPROLOL','Están indicados los IECAS+ Beta bloqueadores para disminuir el riesgo de hospitalización por IC o mortalidad prematura.',45,NULL),(585,'ESTATINAS','Los inhibidores de HMG-CoA reductasa (estatinas) se pueden usar para reducir los niveles de triglicéridos, pero no son tan efectivos',48,NULL),(586,'EZETIMIBA','La ezetimiba es un inhibidor selectivo de la absorción intestinal, a nivel del yeyuno, del colesterol y de otros esteroles de origen vegetal relacionados, tanto procedentes de la dieta como de la vesícula biliaR.',48,NULL),(587,'CONTROL DE GLICEMIA','\nLos triglicéridos elevados pueden deberse a múltiples motivos diferentes, que incluyen diabetes mellitus mal controlada, hipotiroidismo, una muestra de sangre no en ayunas o simplemente hipertrigliceridemia. El tratamiento igual que el LDL elevado o el HDL bajo comienza con la dieta, el ejercicio y la pérdida de peso. En el caso de nuestro paciente, controlar la diabetes mejorará significativamente el nivel de triglicéridos.',48,NULL),(588,'GEMFIBROZIL','\nGemfibrozil se usa comúnmente para tratar la hipertrigliceridemia si las modificaciones de la dieta y el estilo de vida no tienen éxito.',48,NULL),(593,'QUILOMICRONES','Los quilomicrones se sintetizan en el enterocito a partir de los lípidos provenientes de la dieta. Tras su paso por los tejidos, se transforman en quilomicrones residuales, que devuelven la Apo CII a los HDL, y son captados por el hígado vía receptores de apoE.',49,NULL),(594,'LDL','Se debe sospechar de hipercolesterolemia familiar en las siguientes condiciones:\n1. Niveles de C-LDL mayores de 190 mg/dl, posterior a la exclusión de causas\nsecundarias de elevación de C-LDL.\n2. Presencia de enfermedad coronaria prematura (hombre menor de 55 años y\nmujer menor de 65 años) en el caso índice y/o en familiar de primer grado.\n3. Niveles de C-LDL sin tratamiento, con una probabilidad de 80% de tener\nhipercolesterolemia familiar:\n 250 mg/dl en adultos de 30 años o más.\n 220 mg/dl en adultos de 20 a 29 años.\n 190 mg/dl en menores de 20 años.\n4. Presencia de xantomas en el caso índice y/o en familiar de primer grado.\n5. Historia familiar de altos niveles de colesterol.\n\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/233_GPC_Dislipidemias/GRR_Dislipidemia.pdf',49,NULL),(595,'VLDL',' Son complejos macromoleculares sintetizados por el hígado que transportan triglicéridos, ésteres de colesterol y fosfolípidos principalmente hacia los tejidos extrahepáticos',49,NULL),(596,'HDL','Son aquellas lipoproteínas que transportan el colesterol desde los tejidos del cuerpo hasta el hígado.\n\n',49,NULL),(605,'2','La respuesta correcta es de dos: un punto por el aleteo nasal y un punto por el tiraje intercostal lev.',43,NULL),(606,'3','Recuerda que la valoración de Silverman-Andersen evalúa la presencia de dificultad respiratoria solo en el neonato y toma en cuenta 5 parámetros clínicos.',43,NULL),(607,'1','Los parámetros clínicos que son evaluados son: aleteo nasal, quejido espiratorio, tiraje intercostal, retracción xifoidea y disociación toracoabdominal.',43,NULL),(608,'4','Se asignan valores de 0, uno o dos puntos de acuerdo a la presencia o severidad de los mismos. El puntaje ideal es de 0 puntos, 3 se considera dificultad respiratoria leve, cuatro a seis moderada y mayor a 6, grave.\n\nhttp://www.cenetec-difusion.com/CMGPC/SS-226-09/ER.pdf',43,NULL),(609,'8','El neonato presenta FC mayor a 100 (dos puntos), esfuerzo respiratorio adecuado (dos puntos), acrocianosis (un punto), tono muscular disminuido (un punto) y flexión de extremidades (un punto).',42,NULL),(610,'5','El neonato presenta FC mayor a 100 (dos puntos), esfuerzo respiratorio adecuado (dos puntos), acrocianosis (un punto), tono muscular disminuido (un punto) y flexión de extremidades (un punto).',42,NULL),(611,'9','El neonato presenta FC mayor a 100 (dos puntos), esfuerzo respiratorio adecuado (dos puntos), acrocianosis (un punto), tono muscular disminuido (un punto) y flexión de extremidades (un punto).',42,NULL),(612,'7','La respuesta correcta es de 7 puntos al primer minuto, ya que a pesar de nacer con tono muscular disminuido y sin esfuerzo respiratorio, respondió de manera adecuada a las maniobras de reanimación.\n\nhttp://www.cenetec-difusion.com/CMGPC/SS-226-09/ER.pdf',42,NULL),(617,'PRETÉRMINO','A esta categoría pertenecen RN con menos de 37 SDG, en nuestro caso se descarta por tratarse de RN de 37.5 SDG',41,NULL),(618,'DE TÉRMINO','La respuesta correcta es de término, ya que es mayor a 37 SDG',41,NULL),(619,'POSTÉRMINO','A esta categoría pertenecen RN mayores a 42 SDG, en nuestro caso se descarta por tratarse de RN de 37.5 SDG',41,NULL),(620,'PREMATURO EXTREMO','A esta categoría pertenecen RN igual o menor a 28 SDG, en nuestro caso se descarta por tratarse de RN 37.5 SDG\n\nhttp://www.cenetec-difusion.com/CMGPC/SS-226-09/ER.pdf',41,NULL),(629,'TIAZIDA+ IECA','Los tratamientos de segunda línea constituyen la\ncombinación de 2 o más fármacos de la primera línea.',50,NULL),(630,'TIAZIDA','El tratamiento de inicio en pacientes con HAS comprende\n(fármacos de primera línea):\n1. Diuréticos tiazidicos (o clortalidona),\n2. beta-bloqueadores\n3. IECA (Inhibidores de la Enzima Convertidora de\nAngiotensina)\n4. ARA-II (Antagonistas de los Receptores de\nAngiotensina II)\n5. Calcio-antagonista de acción prolongada.\n\nhttp://www.cenetec-difusion.com/CMGPC/IMSS-076-08/ER.pdf',50,NULL),(631,'ARA-II + IECA','No se debe combinar IECA y ARA-II en un mismo régimen\nterapéutico, para el paciente con HAS.',50,NULL),(632,'EJERCICIO Y MODIFICACIÓN DIETA','Para mejorar los niveles de la presión arterial, se\nrecomienda realizar cambios en el estilo de vida que\nincluyan una mejora en la alimentación y actividad física\ndiaria. Debido a que no presento mejoría con estas modificaciones se debe de dar tratamiento farmacológico.',50,NULL),(633,'ASFIXIA NEONATAL','Es la respuesta correcta, ya que presenta depresión y cuenta con el antecedente de prolapso de cordón umbilical.',51,NULL),(634,'DEPRESIÓN POR DROGRAS MATERNAS','Recuerda que en ENARM nunca debes inferir algún dato clínico, si en el caso no refiere antecedente de uso de drogras esta opción solo funciona como distractor.',51,NULL),(635,'HERNIA DIAFRAGMÁTICA ','Los datos brindados son insuficientes para este diagnóstico, recuerda la imagen sugestiva de asas intestinales y burbuja gástrica en una RX de tórax confirman el diagnóstico. Recuerda el 80% es secundaria la hernia de BochdaLeck (Back-Left), o sea postero-lateral izquierda y la causa de insuficiencia respiratoria más que la herniaron de visceral es producida por la hipoplasia pulmonar y secundariamente la hipertensión pulmonar, ambas causas de muerte neonatal.',51,NULL),(636,'SÍNDROME DE DIFICULTAD RESPIRATORIA','Esta patología se caracteriza por INMADUREZ del desarrollo anatómico y fisiológico del neonato PREMATURO, cuyo principal componente es la diferencia cuantitativa y cualitativa de SURFACTANTE que causa desarrollo progresivo de ATELECTASIA PULMONAR DIFUSA y del inadecuado intercambio gaseoso. \n\nhttp://www.cenetec-difusion.com/CMGPC/IMSS-632-13/ER.pdf',51,NULL),(645,'COMPRESIONES TORÁCICAS','Las compresiones o el masaje cardiaco se realizan posterior al PRIMER MINUTO, una vez realizado maniobras iniciales y ventilación positiva sin éxito, con una FC neonatal igual o menor a 60 LPM',52,NULL),(646,'INTUBACIÓN OROTRAQUEAL','Recuerda que esta es opción únicamente con FC menor a 60 LPM después de valorar las compresiones cardiacas coordinadas con VPP y adoptar medidas correctivas de la ventilación. Si posterior a esto el TÓRAX NO SE ELEVA es indicación de INTUBACIÓN.',52,NULL),(647,'VENTILACIÓN CON PRESIÓN POSITIVA ','Debe realizarse ventilación con presión positiva inmediata después de haber dado los pasos iniciales y el neonato no muestra una buena respuesta.',52,NULL),(648,'CONTINUAR CON ESTIMULACIÓN TÁCTIL Y ASPIRACIÓN DE SECRECIONES.','Recuerda que en el agotimo de GPC esto únicamente se realiza los primero 30 segundos, posterior a esto si la FC es menor a 100 LPM se debe realizar VVP y monitoreo de la SpO2.\n\nhttp://www.cenetec-difusion.com/CMGPC/IMSS-632-13/ER.pdf',52,NULL),(649,'TOMOGRAFÍA DE CRÁNEO','Los datos clínicos que presenta el paciente corresponden a asfixia perinatal, que es la condición clínica del neonato que se caracteriza por cursar con pH menor de 7.00 en sangre de cordón (corroborado por medio de gasometría del cordón) y pontaje de APGAR menor o igual a tres a los cinco minutos de vida, además pueden presentar alteraciones neurológicas y/o falla orgánica múltiple.',53,NULL),(650,'RADIOGRAFÍA DE TORAX','Los datos clínicos que presenta el paciente corresponden a asfixia perinatal, que es la condición clínica del neonato que se caracteriza por cursar con pH menor de 7.00 en sangre de cordón (corroborado por medio de gasometría del cordón) y pontaje de APGAR menor o igual a tres a los cinco minutos de vida, además pueden presentar alteraciones neurológicas y/o falla orgánica múltiple.',53,NULL),(651,'BIOMETRÍA HEMÁTICA','Los datos clínicos que presenta el paciente corresponden a asfixia perinatal, que es la condición clínica del neonato que se caracteriza por cursar con pH menor de 7.00 en sangre de cordón (corroborado por medio de gasometría del cordón) y pontaje de APGAR menor o igual a tres a los cinco minutos de vida, además pueden presentar alteraciones neurológicas y/o falla orgánica múltiple.',53,NULL),(652,'GASOMETRÍA DE SANGRE DE CORDÓN','Corresponde a gasometría de cordón umbilical para corroborar la presencia o ausencia de asfixia neonatal.',53,NULL),(673,'PRESIÓN SÍSTOLICA MENOR A 130 Y MAYOR A 100 MMHG','En pacientes menores de 60 años que presenten un adecuado control de la\npresión arterial (<140/90 mm Hg). ',55,NULL),(674,'PRESIÓNN SÍSTOLICA MENOR A 140  Y MAYOR A 110 MMHG','a American Heart Association/American College of Cardiology/American Society,\nrecomienda que en adultos con enfermedad arterial coronaria o con síndrome\ncoronario agudo la tensión arterial objetivo sea diferente según la edad:\n En pacientes de 80 años o menores, mantener por debajo de 140/90 mmHg.\n Si tienen más de 80 años, mantener por debajo de 150/90 mmHg.',55,NULL),(675,'PRESIÓN SÍSTOLICA MENOR A 150 Y MAYOR A 120 MMHG','En adultos mayores de 80 años, se recomienda mantener la presión sistólica, en\n150/80 mmHg como máximo pero no menor de 120 mmHg, ya que en estudios\ncomo SHEP, HYVET y MRC trial, estas cifras incrementaron el riesgo de evento\ncerebrovascular, infarto al miocardio y la mortalidad. http://www.cenetec-difusion.com/CMGPC/IMSS-238-09/RR.pdf',55,NULL),(676,'PRESIÓN SÍSTOLICA MENOR A 140 MMHG Y PRESIÓN DIATÓLICA MENOR A 90 MMHG','El Eighth Joint National Committee (JNC 8) recomienda una tensión arterial objetivo\nen mayores de 60 años de acuerdo a la comorbilidad:\no Sin diabetes mellitus o enfermedad renal crónica mantener por debajo de\n150/90 mmHg.\no Con diabetes mellitus o enfermedad renal crónica mantener abajo de 140/90\nmmHg ',55,NULL),(677,'SÍNDROME DE WEST','Los espasmos infantiles (síndrome de West) se caracterizan por una contracción breve del cuello, el tronco y los músculos del brazo, seguida de una fase de contracción muscular sostenida de dos a tres minutos de duración.',54,NULL),(678,'SÍNDROME DE OHTAHARA','Esta condición es una enfermedad paroxítica caracterizada por espasmos tónicos y convulsiones mioclónicas. Ojo: tiene un patrón EEG de paroxismo-supresión. ',54,NULL),(679,'SINDREME DE LENNOX-GASTAUT','Este síndrome es de las encefalopatías más severas de la infancia, caracterizada por la triada electroclínica de actividad generalizada de punta onda lenta (POL) en el electroencefalograma, múltiples tipos de crisis epilépticas y retraso mental. Ojo: sin embargo el 20% de los casos tiene historia previa de síndrome de West.',54,NULL),(680,'SÍNDROME DE DOOSE','Esta epilepsia es también conocida como Epilepsia Mioclónica Astática (EMA), es poco frecuente y severa de la infancia temprana muchas veces resistente al tratamiento. el EEG se caracteriza por anomalías paroxisticas generalizadas. \n\nhttp://www.imss.gob.mx/sites/all/statics/guiasclinicas/244GER.pdf',54,NULL),(681,'ESPASMOS INFANTILES, MICROCEFALIA Y EEG CON HIPSARRITMIA ','La triada clásica definitiva es Espasmos infantiles, microcefalia y EEG con hipsarritmia',56,NULL),(682,'MIOCLONIAS MASIVAS, RETRASO PSICOMOTOR E HIDROCEFALIA','Recordatorio del síndrome de West: generalmente inicia durante el primer año de vida (3-8 meses) y se presenta como contracciones musculares de aparición súbita en flexión, extensión o ambas y con duración de 2-10 segundos.',56,NULL),(683,'MIOCLONÍAS, MICROCEFALIA Y EEG CON HIPSARRITMIA','Durante las crisis ocurren salvas y comprometen los músculos de la cara, tronco y extremidades, desencadenándose durante periodos de somnolencia o al despertar.',56,NULL),(684,'ESPASMOS MASIVOS, RETRASO PSICOMOTOR Y ELECTROENCEFALOGRAMA CON HIPSARRITMIA','En el 60% de los casos se identifica una causa (la más frecuente es esclerosis tuberosa).',56,NULL),(705,'CIERRE DE OJO IPSILATERAL','Recuerda: el desarrollo de la agudeza visual sucede en las primeras semanas de vida, un RN de término debe retirarse de la luz brillante cuando esta se dirige a algún ojo y debe cerrar al mismo tiempo ambos ojos como forma de evitarla directamente.',57,NULL),(706,'APERTURA DE OJO CONTRALATERAL','El desarrollo visual en el lactante dicta que entre la cuarta y sexta semana de vida debe fijar la mirada hacia objetos específicos.',57,NULL),(707,'CIERRE DE AMBOS OJOS','El paciente debe de iniciar a sonreír ante un rostro conocido a las seis semanas de nacido y entre 8 y 12 semanas es capaz de dirigir la mirada a objetos. ',57,NULL),(708,'APERTURA DE AMBOS OJOS','Recuerda: independientemente del cuidador se debe realizar tamizaje para enfermedades de la visión en todo paciente prematuro.\n\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/029_GPC_NinoSano/IMSS_029_08_EyR.pdf',57,NULL),(713,'PREMATUREZ','Recuerda los puntos clave: ante luz directa, un lactante debe cerrar ambos ojos.',58,NULL),(714,'MADRE QUE REFIERE SIGNO DE ALARMA','Si el lactante es mayor a 12 semanas de edad debe ser capaz de fijar la mirada.',58,NULL),(715,'HOSPITALIZACIÓN PROLONGADA','Pacientes mayores a 12 semanas deben ser capaces de seguir objetos y sonreír ante un rostro conocido.',58,NULL),(716,'RETRASO DEL DESARROLLO','Un paciente prematuro debe ser valorado para tamizaje de enfermedades visuales.',58,NULL),(721,'AFECTACIÓN CONTINUA DEL COLÓN','',60,NULL),(722,'PRESENCIA DE INFLMACIÓN TRANSMURAL','',60,NULL),(723,'PRESENCIA DE FÍSTULAS','',60,NULL),(724,'ASPECTO ENDÓSCOPICO DE EMPEDRADO','',60,NULL),(773,'SUCRALFATO','',59,NULL),(774,'ANTAGONISTA DE H2','',59,NULL),(775,'ANTIÁCIDOS Y PROCINÉTICOS','',59,NULL),(776,'INHIBIDOR DE LA BOMBA DE PROTONES','',59,NULL),(789,'S3','En una mujer embarazada  es fisiológico encontrar: \nUn soplo sistólico de bajo grado, S3 y desdoblamiento de S2. \nEn un embarazo normal se produce una serie de cambios cardiovasculares, como el aumento del gasto cardiaco, la distensibilidad arterial y el volumen de líquido extracelular o la disminución de la presión arterial (PA) y la distensibilidad periférica total.',65,NULL),(790,'SOPLO DE EYECCIÓN SISTÓLICA DE BAJO GRADO','En una mujer embarazada  es fisiológico encontrar: \nUn soplo sistólico de bajo grado, S3 y desdoblamiento de S2. \nEn un embarazo normal se produce una serie de cambios cardiovasculares, como el aumento del gasto cardiaco, la distensibilidad arterial y el volumen de líquido extracelular o la disminución de la presión arterial (PA) y la distensibilidad periférica total',65,NULL),(791,'S4','\nSe escucha un S4 anormal en personas con condiciones que aumentan la resistencia al llenado ventricular, como un ventrículo izquierdo débil.',65,NULL),(792,'EDEMA EN PIERNAS','\nEl edema es una parte normal del embarazo que es causada por aumento de  sangre y líquido. La hinchazón normal, que también se llama edema, se experimenta en las manos, la cara, las piernas, los tobillos y los pies. Esta retención extra de líquido es necesaria para suavizar el cuerpo, lo que le permite expandirse a medida que el bebé se desarrolla.',65,NULL),(809,'INSUFICIENCIA CARDÍACA CONGESTIVA EN PACIENTE CON EPOC','El pacienet presenta datos de hipertrofia ventricular izquierda. Una de las causas y la cual concuerda con nuestro paciente es la hipertensión arterial sistémica.',61,NULL),(810,'NINGUNA DE LAS OPCIONES','La causa mas comun de insuficiencia cardiaca es por cardiopatia isquemica, mayormente por infarto del miocardio. Otras de las causas mayormnete asociadas es la hipertensión arterial sistémica, la cual ocasiono una hipertrofia ventricular izquierda previa a la insuficiencia cardiaca.',61,NULL),(811,'CARDIOPATÍA ISQUÉMICA CON DISFUNCIÓN SISTÓLICA','La causa mas comun de insuficiencia cardiaca es por cardiopatia isquemica, mayormente por infarto del miocardio. El cuadro clínico de nuestro paciente no sugiere patología isquémica.',61,NULL),(812,'CARDIOPATÍA HIPERTENSIVA EN INSUFICIENCIA CARDÍACA','La causa mas comun de insuficiencia cardiaca es por cardiopatia isquemica, mayormente por infarto del miocardio. Otras de las causas mayormnete asociadas es la hipertensión arterial sistémica, la cual ocasiono una hipertrofia ventricular izquierda previa a la insuficiencia cardiaca.\nhttp://www.cenetec-difusion.com/CMGPC/SS-219-09/ER.pdf',61,NULL),(813,'FUROSEMIDA','Los diuréticos de asa, o diuréticos de techo alto, como la furosemida, son los más potentes y rápidamente producen una diuresis intensa dependiente de la dosis de duración relativamente corta. ',62,NULL),(814,'DOXAZOSINA','La doxazosina es un fármaco bloqueante a-adrenérgico utilizado en el tratamiento de la hipertensión y de la hiperplasia benigna de próstata. ',62,NULL),(815,'NIFEDIPINO','Inhibe el flujo de iones Ca al tejido miocárdico y muscular liso de arterias coronarias y vasos periféricos.',62,NULL),(816,'METOPROLOL','Bloqueador beta-1-adrenérgico (cardioselectivo) con nula actividad simpaticomimética intrínseca y escasa o nula acción estabilizadora de membrana.',62,NULL),(817,'CARDIOMIOPATÍA HIPERTRÓFICA','La cardiomiopatía hipertrófica se hereda como un rasgo autosómico dominante y se atribuye a mutaciones en uno de varios genes que codifican a las proteínas del sarcómero. Causa de muerte subita en el joven deportista.',63,NULL),(818,'COCAÍNA','El uso constante de cocaína pude causar diferentes cardiopatías. puede generar hipertensión aguda,\ndisfunción endotelial y el daño vascular, estado protrombótico, alteración del flujo sanguíneo cerebral, vasoconstricción de las arterias cerebrales inducida por el efecto bloqueador de sodio de la cocaína. Se relaciona con cardiomiopatía dilatada.',63,NULL),(819,'CARDIOMIOPATÍA DILATADA',' Se define como miocardiopatía dilatada (MD) a la combinación de dilatación y de disfunción sistólica del ventrículo izquierdo o de ambos ventrículos1. Su origen puede ser idiopático o específico (de origen isquémico, hipertensivo, inflamatorio y otros). La MD se puede expresar clínicamente como un hallazgo casual de cardiomegalia, o ser responsable de arritmia, embolismo, insuficiencia cardíaca o de muerte súbita. ',63,NULL),(820,'SINDROME DE WOLFF PARKINSON WHITE','Se diagnostica de síndrome de Wolff Parkinson White a aquellos pacientes con preexcitación en el electrocardiograma e historia clínica de palpitaciones.  \nLa presentación clínica más habitual son episodios paroxísticos de palpitaciones, de carácter benigno, aunque en estos pacientes la probabilidad de muerte súbita es superior a la población general.',63,NULL),(821,'ESTENOSIS MITRAL','La insuficiencia cardíaca izquierda produce dificultad respiratoria con el ejercicio físico, así como al momento de acostarse o súbitamente durante el sueño y es consecuencia de una reducción del gasto del ventrículo izquierdo. Si ocurre una hipertensión pulmonar el paciente presentará con edema, ascitis, anorexia y fatiga. La ruptura de capilares pulmonares o bronquiales puede causar sangrado al toser. ',64,NULL),(822,'COARTACIÓN DE LA AORTA','Cuando es leve no suele producir síntomas, pudiendo ser un hallazgo casual en una exploración realizada con otro motivo, sobretodo en pacientes jóvenes con hipertensión severa y no explicada. En estos casos es característico el hallazgo de diferencias en la presión arterial y la intensidad de los pulsos entre la zona proximal al ductus (brazos) y la distal (piernas).',64,NULL),(823,'INSUFICIENCIA TRICUSPIDEA','En la insuficiencia tricuspidea la disnea siempre es moderada y sin crisis nocturnas de disnea paroxística ni edema agudo del pulmón. Se presenta con\ningurgitación venosa del cuello, con pulso venoso sistólico y evidente reflujo hepatoyugular de Rondot; esto se refleja en una presión venosa central muy elevada.\nSoplo sistólico en foco tricuspídeo, que aparece en región xifoidea, de carácter rudo y tono elevado sobre el borde izquierdo del esternón que se propaga hacia la punta y la axila derecha. A veces se acompaña de estremecimiento (thrill).Hepatomegalia congestivo dolorosa, que puede acompañarse de ascitis, edemas en los miembros inferiores y reflujo hepatoyugular.',64,NULL),(824,'ESTENOSIS AÓRTICA','La insuficiencia cardíaca izquierda produce dificultad respiratoria con el ejercicio físico, así como al momento de acostarse o súbitamente durante el sueño y es consecuencia de una reducción del gasto del ventrículo izquierdo. Si ocurre una hipertensión pulmonar el paciente presentará con edema, ascitis, anorexia y fatiga. La ruptura de capilares pulmonares o bronquiales puede causar sangrado al toser. ',64,NULL),(829,'BORRELIA BURGDORFERI','El paciente presenta una artropatía migratoria, no es simétrica y mejora la articulación previamente afectada . Los agentes causales mayormente asociados son gonorrea, fiebre reumática y la enfermedad de Lyme (b. burgdorferi). Esta ultima se transmite por la garrapata ixodes y se suele presentar con eritema migratorio al inicio de la enfermedad.\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/588_GPC_Exantemasinfecciososenlainfancia/588GRR.pdf',66,NULL),(830,'ARTRITIS REUMATOIDE','El diagnóstico de AR se debe basar primordialmente en una exploración fisica en donde se encuentre artritis al menos en tres articulaciones, involucro simétrico de articulaciones metacarpofalángicas o metatarsofalángicas y rigidez matutina de 30 minutos.',66,NULL),(831,'LUPUS ERITEMATOSO SITÉMICO','El 90 % de los pacientes con lupus presenta artritis simétrica, inflamaciones articulares, siendo las articulaciones más afectadas las interfalángicas proximales y metacarpofalángicas de manos, muñecas y rodillas, aunque puede afectarse cualquier otra articulación.',66,NULL),(832,'PARVOVIRUS B19','En niños suele ocasionar eritema infeccioso la cual semeja una \"mejilla bofeteada\". En el adulto puede ser imitadora de artritis reumatoide debido a que ocasiona una poliartritis simétrica.',66,NULL),(841,'ANTICUERPOS ANTINUCLEARES','Se suelen encontrar en LES, Sjogren y esclerosis sitémica. Se encuentra en una 5% de la población normal.',67,NULL),(842,'ANTI DNA','Es especifico de Lupus Eritematoso Sistémico, en un 60% se encuentran. También es un indicador de enfermedad y de nefritis lupica. ',67,NULL),(843,'ANTI SMITH','Es especifico de Lupus Eritematoso Sistémico, en un 20 a 30% se encuentran.',67,NULL),(844,'ANTI CARDIOLIPINA','El sindrome de anticuerpos antifosfolípido (SAAF)constituye una enfermedad protombótica autoinmune. Se asocia con trombosis venosa o arterial, abortos o perdida fetal recurrente. Se caracteriza por presentar titulos elevados de anticuerpos antifosfolípido circulantes( anticardiolopina IgG o IgM, anticoagulante lúpico o anti B2 Glucoproteína).\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/394_IMSS_10_Acs_Antifosfolipidos/EyR_IMSS_394_10.pdf',67,NULL),(861,'ASPIRINA','En el paciente asintomático con anticuerpos antifosfolípidos positivos el tratamiento de elección es aspirina con 75 a 150 mg dia.',69,NULL),(862,'WARFARINA ','La paciente presenta un cuadro clínico compatible con sindrome antifolípido. El tratamiento para trombosis venosa o arterial recurrentes es la warfarina sola o en combinación con aspirina o heparina.\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/394_IMSS_10_Acs_Antifosfolipidos/EyR_IMSS_394_10.pdf',69,NULL),(863,'CLOPIDROGREL','Inhibidor de la vía inducida por el adenosín difosfato (ADP) para la agregación plaquetaria. Se utiliza primordialmente para el tratamiento de la enfermedad arterial coronaria y enfermedad vascular periférica.',69,NULL),(864,'METOTREXATE','Es un antimetabolito que posee actividad antiproliferativa e inmunosupresora por inhibir competitivamente a la enzima dihidrofolato reductasa. Se usa principalmnete en el tratamiento de artritis reumatoide, psoriasis e inducción de aborto.',69,NULL),(869,'ANA POSITIVOS','Los anticuerpos antinucleares (AAN) se pueden encontrar en individuos normales, particularmente al envejecer. Sin embargo, casi siempre se presentan en personas con lupus eritematoso (lupus) y frecuentemente en pacientes con artritis reumatoide u otras enfermedades reumáticas de los tejidos conectivo',68,NULL),(870,'HLA- B27','El médico puede ordenar análisis de sangre para indagar la presencia del gen HLA-B27 si sospecha que puede tener espondilitis anquilosante (EA) u otra espondiloatropatía.',68,NULL),(871,'ANTI PÉPTIDO CITRULINADOS POSITIVOS','Esta prueba que sirve para confirmar el diagnóstico de artritis reumatoide. El anticuerpo anti-péptido cíclico citrulinado (Anti-CCP) frecuentemete se analiza en combinación con el factor reumatoide mediante una muestra de sangre.\nAnalizar ambos puede ayudar a establecer y confirmar el diagnóstico correcto ya que la combinación de estas pruebas tiene casi un 100% de valor predictivo positivo de que el paciente tiene AR. Además, el anti-CCP también puede ayudar a indicar cómo le afectará la enfermedad o predecir la necesidad de una terapia más agresiva.\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/195_ARTRITIS_REUMATOIDE/Artritis_reumatoidE_EVR_CENETEC.pdf',68,NULL),(872,'FACTOR REUMATOIDE ','Se presenta en 70 a 80% en pacientes con artritis reumatoide. En el análisis pueden ser negativos durante los primeros meses, haciendo la prueba menos útil para el diagnóstico temprano. Estos factores también existen en pacientes que no presentan ninguna enfermedad y en pacientes con otras enfermedades, pero con menor frecuencia que en los que padecen AR.',68,NULL),(873,'RESONANCIA MAGNÉTICA','',70,NULL),(874,'TOMOGRAFÍA COMPUTARIZADA','',70,NULL),(875,'EXÁMEN DE LIQUIDO SINOVIAL CON LUZ POLARIZADA','',70,NULL),(876,'ARTROSCOPÍA DE RODILLA ','',70,NULL),(881,'INHIBE LA SINTESIS DE PARED CELULAR','La penicilina inhibe la tercera y última etapa de la síntesis de la pared celular bacteriana mediante la unión a determinadas proteínas de la pared celular.',71,NULL),(882,'PREVIENE EL ENSAMBLAJE DE MICROTÚBULOS','La colchicina previene el ensamblaje de microtúbulos y, por lo tanto, interrumpe la activación de inflamasión, la quimiotaxis de células inflamatorias basada en microtúbulos, la generación de leucotrienos, citoquinas y la fagocitosis.',71,NULL),(883,'DISMINUYE LA DEGRADACIÓN DE ACIDO ÚRICO','El tratamiento para la gota es el disminuir la producción de acido úrico ',71,NULL),(884,'INHIBE LA ESQUALENO EPOXIDASA','Es el mecanismo de acción de la terbinafina. Usado primordialmente en el tratamiento de las dermatofitosis.',71,NULL),(897,'GLOMERULONEFRITIS POSESTREPTOCÓCICA','Aparece como una complicación común de las infecciones causadas por bacterias del género Streptococcus, típicamente el impétigo y la faringitis estreptocócica. La pregunta refiere complicación cardiaca',72,NULL),(898,'CARDIOMIOPATÍA DILATADA',' Se define como miocardiopatía dilatada (MD) a la combinación de dilatación y de disfunción sistólica del ventrículo izquierdo o de ambos ventrículos. Su origen puede ser idiopático o específico (de origen isquémico, hipertensivo, inflamatorio y otros). La MD se puede expresar clínicamente como un hallazgo casual de cardiomegalia, o ser responsable de arritmia, embolismo, insuficiencia cardíaca o de muerte súbita.',72,NULL),(899,'ESTENOSIS TRICUSPIDEA','La válvula tricuspidea también puede ser afectada en la fiebre reumática pero es menos frecuente. Soplo diastólico mayormente escuchado en el cuarto espacio intercostal izquierdo.',72,NULL),(900,'ESTENOSIS MITRAL','La paciente presenta el diagnóstico de fiebre reumática. Dentro de las complicaciones cardiacas mayormente asociada es la estenosis de la válvula mitral, la cual se escucha un soplo diastólico en el apex cardiaco, con chasquido de apertura.',72,''),(905,'SOPLO DIASTOLICO CON CHASQUIDO DE APERTURA','Es característico en la estenosis mitral.',73,NULL),(906,'SOPLO SISTÓLICO CRESCENDO-DECRESCENDO \nIRRADIADO A CUELLO','El soplo de la estenosis aórtica es típicamente\nsistólico, precedido de un clic de eyección y es\nmejor detectado en el segundo espacio\nintercostal derecho. El soplo se irradia al cuello,\ndonde también se puede palpar frémito. El\ncomponente aórtico del segundo ruido está\nreducido o ausente por lo que el segundo ruido\npuede ser único.\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/154_GPC_ESTENOSIS_AORTICA/SSA_154_08_EyR_Estenosis_aortica.pdf',73,NULL),(907,'SOPLO HOLOSISTÓLICO IRRADIADO A CUELLO','Soplo holosistólico acentuado por la inspiración se encuentra en la insuficiencia tricuspidea.',73,NULL),(908,'SOPLO SISTÓLICO ACENTUADO CON INSPIRACIÓN','En la estenosis pulmonar se encuentra un soplo sistólico en el segundo espacio intercostal  izquierdo el cual se acentúa con la inspiración.',73,NULL),(909,'KETOROLACO','El paciente presenta algunos factores de riesgo para el desarrollo de un conducto arterioso persistente como prematurez y madre que ingiere anticonvulsivantes durante el embarazo. ',74,NULL),(910,'INDOMETACINA ','LA INDOMETACINA es el fármaco estándar para el tratamiento conservador de la persistencia del conducto arterioso.',74,NULL),(911,'ADRENALINA','El paciente tiene indicaciones para el tratamiento conservador como peso mayor a 1000 gr, no uso de ventilación mecánica ni datos de apnea.  El fármaco indicado para el tratamiento  es la indometacina. La adrenalina no esta indicada. ',74,NULL),(912,'DOPAMINA ','Otro fármaco que se puede utilizar es el ibuprofeno, que tiene una eficacia similar al primer fármaco. La dopamina puede ser benéfica cuando hay daño miocárdico, sin embargo puede potenciar un cortocircuito izquierda-derecha. ',74,NULL),(913,'PESO MAYOR A 1000G','El paciente tiene indicaciones para el tratamiento conservador como peso mayor a 1000 gr, no uso de ventilación mecánica ni datos de apnea.  ',75,NULL),(914,'DISFUNCIÓN MIOCÁRDICA ','El paciente presenta algunos factores de riesgo para el desarrollo de un conducto arterioso persistente como prematurez y madre que ingiere anticonvulsivantes durante el embarazo. ',75,NULL),(915,'PESO MENOR A 3000G','El fármaco indicado para el tratamiento  es la indometacina. Otro fármaco que se puede utilizar es el ibuprofeno, que tiene una eficacia similar al primer fármaco. La dopamina puede ser benéfica cuando hay daño miocárdico, sin embargo puede potenciar un cortocircuito izquierda-derecha. La adrenalina no esta indicada. ',75,NULL),(916,'APGAR MAYOR A 5','LA INDOMETACINA es el fármaco estándar para el tratamiento conservador de la persistencia del conducto arterioso.',75,NULL),(917,'HIPERPLASIA PILÓRICA\n','Son recién nacidos que en la valoración inicial se pasa por alto la revisión de la permeabilidad esofágica y se pasan al alojamiento conjunto, pero poco después al iniciar la alimentación de seno materno presentan síntomas como dificultad respiratoria al alimentarse, tos, cianosis y regurgitación del alimento casi instantáneamente. ',76,NULL),(918,'HERNIA DIAFRAGMÁTICA\n\n','De tratarse de hernia diafragmática la más común es de tipo Bochdalek donde el principal problema es la hipoplasia pulmonar y secundariamente hipertensión pulmonar manifestándose como dificultad respiratoria.',76,NULL),(919,'ATRESIA ESOFÁGICA \n','Si tienes antecedentes de polihidramnios siempre debes de descartar la atresia esofágica. ',76,NULL),(920,'ATRESIA DE COANAS','El tipo mas frecuente de atresia esofágica es el tipo III.',76,NULL),(925,'CULTIVO DE CÉLULAS DE SANGRE PERIFÉRICA\n','El cultivo de células de sangre periférica no se recomienda porque es un método diagnóstico de alto costo, no disponible en todos los centros hospitalarios con resultados en 4 semanas posterior a la toma. ',78,NULL),(926,'DETERMINACIÓN DE ANTICUERPOS POR ELISA\n','En los pacientes menores de 18 meses las pruebas de detección de anticuerpos contra el VIH por método de Elisa no establecen el diagnostico de la infección debido a la transferencia prenatal de anticuerpos maternos, por lo que se debe emplear una prueba virológica. ',78,NULL),(927,'REACCIÓN EN CADENA DE LA POLIMERASA\n\n','La detección de ADN de VIH por PCR o carga viral (CV) es el método diagnostico recomendado en este grupo etario porque la sensibilidad es mayor al 90% cuando se realiza entre las 2 y 4 semanas de vida extrauterinas. ',78,NULL),(928,'DETECCIÓN DE ANTÍGENO P24','La detección del antígeno p25 tampoco se recomienda por que su sensibilidad es menor a la del PCR. EN los pacientes menores de 18 meses las pruebas convensionales de detección de anticuerpos no son útiles porque tienen anticuerpos maternos contra el virus, por tanto la PCR es la indicada por su disponibilidad y buena sensibilidad. La máxima sensibilidad de esta prueba se registra posterior a las 2 semanas de vida.',78,NULL),(929,'A LOS 12 MESES DE EDAD\n','En los pacientes menores de 18 meses las pruebas de detección de anticuerpos contra el VIH por método de Elisa no establecen el diagnostico de la infección debido a la transferencia prenatal de anticuerpos maternos, por lo que se debe emplear una prueba virológica. ',79,NULL),(930,'ENTRE LAS 2 Y 4 SEMANAS DE VIDA\n','El cultivo de células de sangre periférica no se recomienda porque es un método diagnóstico de alto costo, no disponible en todos los centros hospitalarios con resultados en 4 semanas posterior a la toma. ',79,NULL),(931,'A LOS 24 MESES DE EDAD\n','La detección de ADN de VIH por PCR o carga viral (CV) es el método diagnostico recomendado en este grupo etario porque la sensibilidad es mayor al 90% cuando se realiza entre las 2 y 4 semanas de vida extrauterinas. ',79,NULL),(932,'DENTRO DE LAS PRIMERAS 48 HORAS','La detección del antígeno p25 tampoco se recomienda por que su sensibilidad es menor a la del PCR. EN los pacientes menores de 18 meses las pruebas convensionales de detección de anticuerpos no son útiles porque tienen anticuerpos maternos contra el virus, por tanto la PCR es la indicada por su disponibilidad y buena sensibilidad. La máxima sensibilidad de esta prueba se registra posterior a las 2 semanas de vida.',79,NULL),(933,'MIOPATÍA ASOCIADA A HIPOLIPEMIANTES\n','Es probable que se pregunte este caso clínico pero como dermatomiositis clásica. Este caso presenta el tipo eritema en heliotropo (edema periorbitario), eritema en la región de V del escote y debilidad en la cintura escapular y pélvica acompañado de CPK elevada, se trata entonces de dermatomisitis juvenil, ya que de ser mayor de 16 años de edad se hablaría de una clásica. ',80,NULL),(934,'DERMATOMIOSITIS PURA\n','La dermatomiositis pura o clásica sería el diagnóstico correcto en caso que se tratase de un paciente adulto o bien mayor de 16 años de edad.',80,NULL),(935,'DERMATOMIOSITIS JUVENIL\n','El uso de bezafibrato te puede confundir porque existe una miopatía pero asociada a estatinas, que se presenta como Polimiositis, no como Dermatomiositis',80,NULL),(936,'POLIOMIOSITIS JUVENIL','El mecanismo fisiopatogénico es por destrucción de musculo y piel asociado a autoinmunidad. El tratamiento inicial es con esteroides. ',80,NULL),(937,'TIPO II\n\n','Corresponde al 2% representa una atresia esofágica con fístula traqueoesofágica proximal',77,NULL),(938,'TIPO V\n','Corresponde al 2% representa una Fístula traqueoesofágica en H',77,NULL),(939,'TIPO I','Corresponde al 10% de las atresias esofágicas la cual se caracteriza por ser aislada, sin fístula traqueoesofágica',77,NULL),(940,'TIPO III','Es el tipo más frecuente de atresia esofágica. Representa el 80% de esta patología. ',77,NULL),(941,'AZATIOPRINA\n','Es probable que se pregunte este caso clínico pero como dermatomiositis clásica. Este caso presenta el tipo eritema en heliotropo (edema periorbitario), eritema en la región de V del escote y debilidad en la cintura escapular y pélvica acompañado de CPK elevada, se trata entonces de dermatomisitis juvenil, ya que de ser mayor de 16 años de edad se hablaría de una clásica. ',81,NULL),(942,'PREDNISONA\n','El tratamiento inicial es con esteroides. ',81,NULL),(943,'CICLOFOSFAMIDA\n\n','El uso de bezafibrato te puede confundir porque existe una miopatía pero asociada a estatinas, que se presenta como Polimiositis, no como Dermatomiositis.El mecanismo fisiopatogénico es por destrucción de musculo y piel asociado a autoinmunidad.',81,NULL),(944,'METOTREXATE','Recuerda el tratamiento inicial es con esteroides. ',81,NULL),(957,'ASPIRINA','En la pericarditis aguda posterior al infarto de miocardio, se deben evitar tanto los AINE como los esteroides para evitar la interferencia con la cicatrización / remodelación ventricular. El tratamiento de elección en estos pacientes es dosis alta de aspirina.\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/463_GPC_PericarditisAdulto/IMSS-463-11GRR_PERICARDITIS_EN_EL_ADULTO.pdf',83,NULL),(958,'IBUPROFENO','En pericarditis no secundaria a infarto al miocardio, el tratamiento de elección son AINES en especial el ibuprofeno agregando la colchicina.\n',83,NULL),(959,'PERICARDIECTOMÍA','Es el único tratamiento en el caso de constricción permanente del pericardio.',83,NULL),(960,'PREDNISONA','Los esteroides generalmente solo se usan en casos severos o refractarios; también pueden estar indicados en casos donde la causa presunta es un trastorno del tejido conectivo, enfermedad autoinmune o uremia.',83,NULL),(961,'TORACOSTOMÍA','Este acceso a la cavidad pleural, se usa para el drenaje y evacuación de aire, sangre, bilis, pus u otros líquidos; es una de las prácticas más frecuentes y de más rápido dominio por el personal médico de urgencias, terapia intensiva y cirugía ',82,NULL),(962,'ADMINASTRAR OXIGENO AL 100%',' La oxigenoterapia debe ser aplicada cuando existe disminución de la cantidad de oxígeno en la sangre, ya sea por insuficiencia respiratoria, insuficiencia circulatoria, anemia, atmósfera enrarecida con humos o gases.',82,NULL),(963,'INTERVENCIÓN CORONARIA ','La intervención coronaria percutánea primaria (ICPP) es el tratamiento estándar para los pacientes con infarto agudo de miocardio con elevación del segmento ST.',82,NULL),(964,'PERICARDIOCENTESIS','La pericardiocentesis tiene ultilidad tanto diagnóstica como terapéutica, guiada por ecocardiografía. Sus indicaciones son paciente con derrame sintomático y taponamiento cardiaco, alta sospecha etiológica en una pericarditis (neoplásico, tuberculoso o pururlento), derrame pericárdico moderado a severo sin compromiso hemodinámico.',82,NULL),(973,'NORMAL ALTA','Es catalogada como presión sistólica entre 130-139 mmHg y diastólica de 85-89 mmHg.',84,NULL),(974,'GRADO 1','Es catalogada como presión sistólica entre 140-159 mmHg y diastólica de 90-99 mmHg.',84,NULL),(975,'GRADO 2','Es catalogada como presión sistólica entre 160-179 mmHg y diastólica de 100-109 mmHg.',84,NULL),(976,'GRADO 3','Es catalogada como presión sistólica mas o igual de 180 mmHg y diastólica de 110 mmHg.',84,NULL),(981,'DISECCIÓN AÓRTICA','Disección aórtica o aneurisma aórtico disecante es una afección potencialmente mortal en la cual se presenta sangrado dentro y a lo largo de la pared de la aorta. Se suele presentar como un dolor fuerte, agudo, punzante, desgarrador. Sentirse por debajo del esternón y se irradia luego bajo los omóplatos o a la espalda\nIrradiarse a los hombros, el cuello, los brazos, la mandíbula, el abdomen y las caderas.\nCambiar de posición: el dolor se mueve de manera característica hacia los brazos y piernas, a medida que la disección aórtica empeora\n',85,NULL),(982,'ATEROESCLEROSIS',' Ateroesclerosis es un síndrome caracterizado por el depósito e infiltración de sustancias lipídicas en la capa íntima de las paredes de las arterias de mediano y grueso calibre. Es la forma más común de arteriosclerosis. Puede presentarse con en cambio de pulsos, la VSG elevada, la edad, sexo y la  anemia sugieren arteritis de Takayasu.',85,''),(983,'POLIARTERITIS NODOSA','Es una vasculitis sistémica de arterias musculares pequeñas o medianas, que generalmente involucra vasos renales y viscerales, pero que respeta la circulación pulmonar. \n La poliarteritis nodosa puede presentarse en niños.  En poliarteritis nodosa, los aneurismas pequeños se ensartan como las cuentas de un rosario,  por lo tanto, el \"signo del rosario\" es una característica diagnóstica importante de la vasculitis. La discrepancia en pulsos es característico de enfermedad de Takayasu.',85,NULL),(984,'ENFERMEDAD DE TAKAYASU','La Arteritis de Takayasu es una vasculitis de grandes vasos, que comúnmente se presenta entre la segunda y tercera década de la vida. Afecta a ambos sexos, con predominio del género femenino, relación mujer : hombre 8.5:1. Se presenta con una fase temprana caracterizada por inflamación difusa o granulomatosa en la superficie media y adventicia con sintomas sistémicos e inespecificos. En la fase tardia o crónica se caracteriza por estenosis arterial u oclusión arterial y aneurismas.Las arterias mayormente afectadas son arteria subclavia, artera carótida común y aorta torácica.\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/423_GPC_ArteritisTakayasu/IMSS-423-11-GRR_Arteritis_de_Takayasu.pdf',85,NULL),(993,'DERIVAR A HOSPITAL DE TERCER NIVEL','',87,NULL),(994,'REALIZAR UNA RADIOGRAFIA DE TÓRAX','',87,NULL),(995,'ELECTROCARDIOGRAMA','',87,NULL),(996,'ULTRASONIDO TRANSESOFÁGICO','',87,NULL),(997,'HIPERTENSIÓN MAL CONTROLADA','La coartación de la aorta se relaciona con enfermedades que aumenten la estrés de la pared torácica como la hipertensión mal controlada, feocromocitoma, cocaína.',86,NULL),(998,'SINDROME DE MARFAN ','La coartación de la aorta se   se asocian a anormalidades de la pared media de la aorta como sindrome de marfan, Ehlers Danlos, Turner, Loeys Dietz.',86,NULL),(999,'SINDROME DE TURNER','La coartación de la aorta se   se asocian a anormalidades de la pared media de la aorta como sindrome de marfan, Ehlers Danlos, Turner, Loeys Dietz.',86,NULL),(1000,'SINDROME DE NOONAN','Síndrome de Noonan es un trastorno genético con una mutación en el cromosoma 12, caracterizado por talla baja, cardiopatía, rasgos faciales típicos y alteraciones esqueléticas. La estenosis valvular pulmonar y la miocardiopatía hipertrofica son las cardiopatías mayormente asociadas.No se le relaciona a coartación de la aorta.\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/414_IMSS_10_diseccion_aortica/GRR_IMSS_414_10.pdf',86,NULL),(1009,'REDUCCIÓN DE PRESIÓN ARTERIAL','La hipertensión arterial es el factor de riesgo mas importante que se pueda controlar para no desarrollar un Evento Vascular Cerebral (EVC).\nhttp://www.cenetec.salud.gob.mx/descargas/gpc/CatalogoMaestro/114_GPC_VigpacconsecEVC1NA/ENF_VASCULAR_C_RR_CENETEC.pdf',88,NULL),(1010,'REDUCCIÓN DE LA GLUCOSA','La reducción de la glucosa disminuye las complicaciones de la DM, incluyendo retinopatía, neuropatía y nefropatía. No tiene la misma relación reducción para disminuir el riesgo de EVC.',88,NULL),(1011,'DEJAR DE FUMAR','EVC es multifactorial, aunque el tabaquismo esta relacionado con el, la hipertensión es mayor factor de riesgo.',88,NULL),(1012,'PERDIDA DE PESO','Ayudaria a controlar la glicemia del paciente y el riesgo de enfermedad cardiovascular en general',88,NULL),(1065,'CAPTORPRIL','',100,NULL),(1066,'FUROSEMIDA','',100,NULL),(1067,'HIDRALAZINA','',100,NULL),(1068,'VERAPAMILO','',100,NULL),(1069,'FLÚTER AURICULAR','Suele presentarse con\npalpitaciones, mareo\nsíncope, aturdimiento.\nSe presenta con ondas p en forma de sierra.',47,NULL),(1070,'FIBRILACIÓN AURICULAR','Se caracteriza por la activación auricular rápida en 400 y 700 ciclos por minuto de forma desorganizada. En el ECG se encuentra ausencia de ondas P y la presencia de ondas f.',47,NULL),(1071,'FIBRILACIÓN VENTRICULAR','La fibrilación ventricular (FV) es un ritmo cardíaco rápido y potencialmente mortal que comienza en las cámaras inferiores del corazón. Puede ser desencadenado por un ataque al corazón.\nDebido a que el corazón no bombea adecuadamente durante la fibrilación ventricular, la FV sostenida puede causar presión arterial baja, pérdida del conocimiento o la muerte.\nEl tratamiento de emergencia incluye la desfibrilación inmediata con un desfibrilador externo automático (DEA) y reanimación cardiopulmonar (RCP). La terapia a largo plazo incluye desfibriladores implantables y medicamentos para prevenir la recurrencia.',47,NULL),(1072,'TAQUICARDIA SINUSAL','Se define  como la taquicardia sinusal fisiológica de disparo del nodo sinusal a mas de 100 latidos por minuto.',47,NULL);
