INSERT INTO `Question` VALUES (21,'ADOLESCENTE DE 16 AÑOS CON LESIONES DERMATOLÓGICAS EN CARA Y TRONCO. LAS LESIONES COINCIDEN CON EL CAMBIO DE CIUDAD Y DE DIETA. ADEMÁS DEJAN CICATRIZ QUE PREOCUPA MUCHO AL PACIENTE. E.F.: COMEDONES EN DIFERENTES ESTADIOS DE EVOLUCIÓN. SE REALIZA EL DIAGNOSTICO DE ACNÉ. ¿COMO AFECTA LA UNIDAD PILOSEBACEA?\n\n',30,NULL),(22,'PACIENTE MASCULINO DE 21 AÑOS CON ACNÉ VULGAR DE DOS AÑOS DE EVOLUCIÓN. E.F. COMEDONES ABIERTOS Y CERRADOS EN CARA Y ESPALDA. SE INICIA TRATAMIENTO CON ISTOTRETINOÍNA ORAL. ¿CUAL ES UN EFECTO SECUNDARIO AL TRATAMIENTO?',30,NULL),(23,'PACIENTE FEMENINO DE 18 AÑOS QUE PRESENTA LESIONES EN CARA DE 5 MESES DE EVOLUCIÓN. PRESENTA EL ANTECEDENTE DE MADRE Y HERMANO MAYOR CON ACNÉ. E.F. SE ENCUENTRAN COMEDONES Y PEQUEÑAS PAPULAS, SIN PRESENCIA DE CICATRICES. ¿QUE TIPO DE ACNÉ PRESENTA?',30,NULL),(24,'PACIENTE MASCULINO DE 44 AÑOS CON LESIONES EN PARTE POSTERIOR DE AMBOS CODOS ACOMPAÑADAS DE PRURITO. E.F. LESIONES ERITEMATOSAS CON ESCAMAS Y PÁPULAS. NO HAY AFECTACIÓN ARTICULAR. ¿CUAL ES EL SIGUIENTE PASO A SEGUIR?',30,NULL),(25,'PACIENTE MASCULINO DE 42 AÑOS CON DIAGNÓSTICO DE PSORIASIS SEVERA. SE INICIA TRATAMIENTO CON CICLOSPORINA VIA ORAL. AL SEGUNDO DÍA DEL TRATAMIENTO SE PRESENTAN DATOS DE HIPERSENSIBILIDAD. ¿CUAL DE LOS SIGUIENTES MEDICAMENTOS ES EL MÁS INDICADO PARA SU TRATAMIENTO?',30,NULL),(26,'UN HOMBRE DE 50 AÑOS PRESENTA A SU DERMATÓLOGO POR AMPOLLAS PERSISTENTES. ÉL INFORMA QUE LAS AMPOLLAS COMENZARON EN SUS LABIOS HACE TRES SEMANAS. CONTINÚA DESARROLLANDO NUEVAS LESIONES NUEVAS LESIONES DOLOROSAS EN LOS LABIOS, PERO TAMBIEN EN TRONCO Y LOS BRAZOS. SU DERMATOLOGO REALIZA UNA BIOPSIA DE PERFORACIÓN. SIGNO DE NIKOLSKY POSITIVO. MIENTRAS TANTO SE LE ADMINISTRAN ESTEROIDES TOPICOS Y UN ANESTÉSICO PARA SUS LESIONES DE LA MUCOSA. ¿CUAL ES EL DIAGNÓSTICO MAS PROBABLE?',30,NULL),(27,'\n\n\nUNA NIÑA DE 5 AÑOS SE QUEJA DE PRURITO Y UNA ERUPCIÓN EN LA CARA DE UN DIA DE EVOLUCIÓN. SE PRESENTA A CONSULTA, SE ENCUENTRA TEMPERATURA DE 36.8ºC. E.F.SE ENCUENTRAN MÚLTIPLES VESÍCULAS Y PÚSTULAS CON COSTRA SUBYACENTE COLOR MIEL EN EL MENTÓN. NO HAY AMPOLLAS. EL MEDICO ADVIERTE QUE EXISTE LA POSIBLIDAD DE QUE SUS RIÑONES PUEDEN VERSE AFECTADOS DESPUES DE LA INFECCIÓN. ',30,''),(28,'PACIENTE MASCULINO DE 10 AÑOS SE PRESENTA CON ERUPCIÓN CUTÁNEA QUE EMPEORA A NIVEL DEL ESTERNON. SU MADRE INFORMA  QUE PRESENTA VARIAS ÁREAS CIRCULARES ROJAS QUE HAN CRECIDO EN TAMAÑO Y SE HAN FORMADO COMO ANILLOS. LA FAMILIA RECIENTEMENTE OBTUVO UN CACHORRO QUE HA ESTADO DURMIENDO EN LA CAMA DEL NIÑO. EF LAS LESIONES SON ESCAMOSAS CON PLACAS MARCADAMENTE MARGINADAS. TIENEN UNA CONFIGURACIÓN ANULAR CON ANILLOS CONCÉNTRICOS Y COMPENSACION CENTRAL. SE PRESCRIBE UN MEDICAMENTO TÓPICO. ¿CUAL ES EL TRATAMIENTO MAS ADECUADO?',30,NULL);
INSERT INTO `Question` VALUES (29,'UN NIÑO ES LLEVADO A URGENCIAS, DESPUÉS DE VISITAR A SU MÉDICO DE ATENCIÓN PRIMARIA, QUE OBSERVÓ LESIONES ERITEMATOSAS DESCAMATIVAS EN TODO EL CUERPO (MAS DEL 30% DEL AREA DE LA SUPERFICIE CORPORAL) Y ULCERACIONES DE LAS MEMBRANAS DE LA BOCA MUCOSA DE LA BOCA Y OJOS. RECIENMETEMENTE FUE TRATADO CON PENICILINA POR UNA INFECCIÓN. ¿CUAL ES EL DIAGNÓSTICO MAS PROBABLE?',30,''),(30,'PACIENTE MASCIULINO DE 21 AÑOS ACUDE A URGENCIAS CON UNA ERUPCIÓN DOLOROSA EN DIFERENTES PARTES DEL CUERPO, INCLUIDAS ALGUNAS LESIONES EN BOCA. REFIERE SENTIRSE FEBRIL. E.F. SU PIEL TIENE MÚLTIPLES AMPOLLAS QUE SE DESPRENDEN FACILMENTE CON SOLO UNA MASAJE. EL SARPULLIDO CUBRE 20% DE SU CUERPO. RECIENMTEMENTE SE APLICO LAMOTRIGINA POR SU EPILEPSIA. ¿CUAL DE LOS SIGUIENTES TRATAMIENTOS ES EL MAS ADECUADO ?',30,NULL),(31,'ESTUDIANTE DE MEDICINA DE 25 AÑOS CON ANTECEDENTE DERMATITIS ATOPICA  TRATADA CON ESTEROIDES TÓPICOS Y TACROLIMUS. ACTUALMENTE REFIERE COMENZÓN POR LA NOCHES EL CUAL LE IMPIDE DORMIR. E.F. GRANDES PLACAS ERITEMATOSAS EN LA MANOS Y SUPERFICES DE FLEXIÓN EN RODILLAS Y CODOS.ES CATALOGADA COMO SEVERA ¿CUAL DE LOS SIGUIENTES MEDICAMENTOS DEBE SER AGREGADO AL TRATAMIENTO?\n',30,NULL),(32,'PACIENTE MASCULINO DE 16 AÑOS EL CUAL PRESENTA UNA ERUPCIÓN CUTÁNEA EN CUELLO. SE REMUEVE  UN COLLAR PARA REALIZAR LA EXPLORACIÓN. EF SE ENCUENTRA LESIONES ERITEMATOSAS CON VESICULAS. ¿QUE TIPO DE HIPERSENSIBILIDAD PRESENTA EL PACIENTE?',30,NULL),(33,'PACIENTE FEMENINA DE 17 AÑOS QUE SE PRESENTA A SU UMF  CON LESIONES ERITEMATOSAS EN AMBAS MANOS, FUE TRATADA CON ACEITE DE CANOLA Y CON LA RECOMEDACIÓN DE USAR GUANTES POR EL DIAGNÓSTICO DE  DERMATITIS POR CONTACTO HACE 7 DIAS. EF SE ENCUENTRAN LESIONES ERITEMATOSAS CON VESICULAS EN AMBAS MANOS ¿QUE TRATAMIENTO ES EL INDICADO?\n.',30,NULL),(37,'PACIENTE MASCULINO DE 78 AÑOS EL CUAL ACUDE A URGENCIA POR TRES DIAS DE PALPITACIONES. NIEGA MAREOS, DISNEA Y DOLOR EN PECHO Y DICE QUE DUERME COMODAMENTE CON UNA ALMOHADA EN LA NOCHE. ES DIABÉTICO, HIPERTENSO E HIPERCOLESTEROLEMÍA. INGIERE GLIBURIDA, LISINORPIL E HIDROCLOROTIZIDA. ANTECDENTE DE TABAQUISMO. EF SE ENCUENTRA FC 115LPM Y TA 145/95 MMHG. EN EL ELECTROCADROGRAMA SE ENCUENTRA FIBRILACIÓN AURICULAR CON RESPUESTA VENTRICULAR RÁPIDA. ¿CUAL DE LAS SIGUIENTES ES LA TERAPIA ADECUADA PARA ESTE PACIENTE?\n',15,NULL),(38,'MUJER DE 58 AÑOS ACUDE A URGENCIAS CON PALPITACIONES, QUE NUNCA ANTES HABIA EXPERMENTADO. ANTECEDENTE DE EPOC.  \n EF T 36.8, FC 86, TA 105/70, FR 18, SpO2 94% AIRE AMBIENTE.  SU ECG MUESTRA LO SIGUIENTE. ¿CUAL ES SU LUGAR MAS PROBABBLE DE FOCO ECTÓPCO PARA ESTA ARRITMIA?',15,''),(39,'\n\nPACIENTE MASCULINO DE 76 AÑOS CON ANTECEDENTE DE 5 AÑOS CON FIBRILACIÓN AURICULAR QUE ACUDE AURGENCIAS POR INCAPACIDAD DE MOVER LA PIERNA DERECHA. REFIERE HABER SNTIDO RARO Y CON MAYOR PALIDEZ DESDE HACE DOS HORAS. RECIENTEMENTE SE LE TERMINO SU WARFARINA Y NO LA HA TOMAOD EN DOS SEMANAS. EF. SE ENCUENTRAN PULSOS FEMORAL Y DORSAL AUSENTED EN LA PIERNA DERECHA. ¿CUAL DE LOS SIGUIENTES SERIA EL TRATAMIENTO MAS ADECUADO PARA EL PACIENTE?\n',15,NULL),(40,'PACIENTE MASCULINO DE 68 AÑOS EL CUAL PRESENTA PALPITACIONES, ATURDIMIENTO Y DIFICULTAD PARA RESPIRAR. PRESENTA ANTECEDENTE DE HIPERTENSIÓN TRATADA CON HIDROCLOROTIAZIDA. A LA EF PARACE INCOMODO CON LIGERO DOLOR TORÁCICO, EL PRIMER SONIDO CARDIACO ES DE INTENSIDAD VARIABLE. HAY LEVES CREPITACIONES BIBASILARES EN LA AUSCULTACIÓN PULMONAR Y AUSENCIA DE EDEMA PERIFÉRICO. ECG\nSE ENCUENTRAN ONDAS F. ¿CUAL ES EL TRATAMIENTO A SEGUIR?',15,NULL),(41,'SE ATIENDE A NEONATO PRODUCTO DE LA GESTA TRES DE MADRE DE 25 AÑOS DE EDAD, EMBARAZO DE 37.5 SEMANAS POR FECHA DE ÚLTIMA MENSTRUACIÓN, CON ADECUADO CONTROL PRENATAL, NORMO-EVOLUTIVO. EL NEONATO NACE POR VÍA VAGINAL; NO PRESENTA ESFUERZO RESPIRATORIO, PERO SÍ HIPOTONÍA. SE COLOCA EN CUNA RADIANTE, SE DA POSICIÓN Y LIBERACIÓN DE VÍA AÉREA. SE BRINDA ESTÍMULO CON LO QUE EL PACIENTE PRESENTA ANTES DEL PRIMER MINUTO FC 105 LPM, ESFUERZO RESPIRATORIO ADECUADO, ACROCIANOSIS, TONO MUSCULAR DISMINUIDO Y LIGERA FLEXIÓN DE LAS EXTREMIDADES ANTE ESTÍMULOS. A LOS TRES MINUTOS DE VIDA PRESENTA ALETEO NASAL LEVE Y TIRAJE INTERCOSTAL LEVE. PESO DE 2800 G, TALLA 52 CM. DE ACUERDO CON LAS SEMANAS DE AMENORREA, ¿QUÉ TIPO DE EMBARAZO ES?',16,NULL),(42,'SE ATIENDE A NEONATO PRODUCTO DE LA GESTA TRES DE MADRE DE 25 AÑOS DE EDAD, EMBARAZO DE 37.5 SEMANAS POR FECHA DE ÚLTIMA MENSTRUACIÓN, CON ADECUADO CONTROL PRENATAL, NORMO-EVOLUTIVO. EL NEONATO NACE POR VÍA VAGINAL; NO PRESENTA ESFUERZO RESPIRATORIO, PERO SÍ HIPOTONÍA. SE COLOCA EN CUNA RADIANTE, SE DA POSICIÓN Y LIBERACIÓN DE VÍA AÉREA. SE BRINDA ESTÍMULO CON LO QUE EL PACIENTE PRESENTA ANTES DEL PRIMER MINUTO FC 105 LPM, ESFUERZO RESPIRATORIO ADECUADO, ACROCIANOSIS, TONO MUSCULAR DISMINUIDO Y LIGERA FLEXIÓN DE LAS EXTREMIDADES ANTE ESTÍMULOS. A LOS TRES MINUTOS DE VIDA PRESENTA ALETEO NASAL LEVE Y TIRAJE INTERCOSTAL LEVE. PESO DE 2800 G, TALLA 52 CM. ¿QUÉ TIPO DE CALIFICACIÓN DE APGAR PRESENTA AL MINUTO DE VIDA?',16,NULL),(43,'SE ATIENDE A NEONATO PRODUCTO DE LA GESTA TRES DE MADRE DE 25 AÑOS DE EDAD, EMBARAZO DE 37.5 SEMANAS POR FECHA DE ÚLTIMA MENSTRUACIÓN, CON ADECUADO CONTROL PRENATAL, NORMO-EVOLUTIVO. EL NEONATO NACE POR VÍA VAGINAL; NO PRESENTA ESFUERZO RESPIRATORIO, PERO SÍ HIPOTONÍA. SE COLOCA EN CUNA RADIANTE, SE DA POSICIÓN Y LIBERACIÓN DE VÍA AÉREA. SE BRINDA ESTÍMULO CON LO QUE EL PACIENTE PRESENTA ANTES DEL PRIMER MINUTO FC 105 LPM, ESFUERZO RESPIRATORIO ADECUADO, ACROCIANOSIS, TONO MUSCULAR DISMINUIDO Y LIGERA FLEXIÓN DE LAS EXTREMIDADES ANTE ESTÍMULOS. A LOS TRES MINUTOS DE VIDA PRESENTA ALETEO NASAL LEVE Y TIRAJE INTERCOSTAL LEVE. PESO DE 2800 G, TALLA 52 CM. ¿CUÁNTOS PUNTOS OTORGA LA VALORACIÓN SILVERMAN-ANDERSEN A LOS TRES MINUTOS DE VIDA?',16,NULL),(44,'PACIENTE MASCULINO DE 68 AÑOS ACUDE A CONSULTA DE ATENCIÓN PRIMARIA. PRESENTA MIOCARDIOPATÍA DILATADA CON DISNEA DE ESFUERZO E HINCHAZÓN DE LOS TOBILLOS. ÉL TIENE UNA LARGA HISTORIA DE ENFERMEDAD ARTERIAL CORONARIA Y ABUSO DE ALCOHOL. ¿QUE ESPERA ENCONTRAR ELEVADO?\n',15,NULL),(45,'UN HOMBRE DE 65 AÑOS CON ANTECEDENTES DE MIOCARDIOPATÍA ISQUÉMICA, INSUFICIENCIA CARDÍACA CONGESTIVA, DIABETES MELLITUS Y ENFERMEDAD RENAL CRÓNICA ACUDE A URGENCIAS CON DISNEA PROGRESIVA DE ESFUERZO Y AUMENTO DE PESO DURANTE 8 DÍAS. EF. SE ENCUENTRA UN S3 Y EDEMA PERIFERICO 2+ Y UNA DISTENCIÓN YUGULAR MARCADA. PRESENTA UNA CREATININA SÉRICA DE 1.2MG/DL CON VALOR DE REFERENCIA DE 1.1MG/DL. TROPONINAS DENTRO DE PARÁMETROS NORMALES ¿ CUAL DE LOS SIGUIENTES MEDICAMENTOS ESTA INDICADO PARA DISMINUR LOS SINTOMAS DE ESTE PACIENTE?\n',15,NULL),(46,'MUJER DE 65 AÑOS SIN HISTORIAL MÉDICO PREVIO SE SE PRESENTA A CONSULTA CON DISNEA DE ESFUERZO CADA VEZ MAYOR, EDEMA DE EXTREMIDADES INFERIORES Y UNA PERDIDA DE PESO DE 8KG EN LOS ULTIMOS 3 MESES. ELLA NIEGA CUALQUIER DOLOR EN PECHO. EF. SONIDOS RESPIRATORIOS NORMALES, UN SONIDO DIASTÓLICO TEMPRANO II/ V Y UN EDEMA DE LA EXTREMIDAD INFERIOR 1+. EL ECG  MUESTRA AGRANDAMIENTO AURICULAR IZQUIERDO. ¿CUAL DE LOS SIGUIENTES ES EL DIAGNÓSTICO MAS PROBABLE?',15,NULL),(47,'UNA MUJER DE 68 AÑOS CON USO DE DIGOXINA PRESENTA UN SÍNCOPE. SE REALIZO ECG CON APARIENCIA DE DIENTES DE SIERRA. ¿CUAL ES EL DIAGNÓSTICO MÁS PROBABLE ?',15,NULL),(48,'PACIENTE MASCULINO DE 56 AÑOS CON ANTECDENTES DE OBESIDAD Y DIABETES MELLITUS MAL CONTROLADA. NO PRESENTA QUEJAS FÍSICAS. SU PERFIL LIPÍDICO SE PRESENTA:\n\nCOLESTEROL TOTAL 202 mg / dL\n\nLDL 96 mg / dL\n\nHDL 26 mg / dL\n\nTRIGLICERIDOS 452 mg / dL\n\n¿CUAL DE LAS SIGUIENTES ES LA OPCIÓN TERAPEUTICA MAS RECOMENDABLE?',15,NULL),(49,'PACIENTE MASCULINO DE 32 AÑOS CON DIAGNÓSTICO DE HIPERCOLESTEROLEMIA. ANTECEDENTE DE PADRE CON HIPERCOLESTEROLEMIA POR LA CUAL FALLECE A SUS 44 AÑOS. A LA EF SE ENCUENTRAN XANTELASMAS BILATERALES. ¿QUE SE ESPERA ENCONTRAR ELEVADO?',15,''),(50,'UN HOMBRE DE 45 AÑOS SE PRESENTA A CONSULTA CON DOLORES DE CABEZA FRECUENTES. SU PRESIÓN ARTERIAL FUE DE 160/85, 155/90, 162/90 mmHg. EN TRES CONSULTAS CONSECUTIVAS A PESAR DE HABER INICIADO UNA DIETA BAJA EN SAL \n Y BAJAR DE PESO EN LOS ULTIMOS 6 MESES. ÉL NO ESTA TOMANDO MEDICAMENTO Y NO TIENE NINGÚN OTRO MEDICAMENTO. USTED DECIDE COMENZAR TRATAMIENTO ¿QUE TRATAMIENTO ES EL MÁS ADECUADO?\n',15,NULL),(51,'ATIENDE USTED UN NEONATO PRODUCTO DE LA GESTA UNO DE MADRE DE 16 AÑOS DE EDAD QUE LLEGA A LA SALA DE PARTO CON EMBARAZO DE 37 SDG, PRESENTA PROLAPSO DE CORDÓN UMBILICAL, ADEMÁS DE DILATACIÓN COMPLETA. SE OBTIENE NEONATO HIPOTÓNICO, SIN ESFUERZO RESPIRATORIO NI TONO MUSCULAR, SE DAN PASOS INICIALES SIN LOGRAR QUE PRESENTE ESFUERZO RESPIRATORIO ADECUADO, ADEMÁS DE PRESENTAR FRECUENCIA CARDIACA DE 80 LPM. SE CALIFICA CON APGAR 4 AL PRIMER MINUTO DE VIDA. SE EJECUTAN MANIOBRAS DE REANIMACIÓN NEONATAL Y SE LOGRA AUMENTAR LA FC, PERO SIN ADECUADO ESFUERZO RESPIRATORIO. ¿CUÁL ES EL DIAGNÓSTICO DE PRESUNCIÓN DEL NEONATO?',16,NULL),(52,'ATIENDE USTED UN NEONATO PRODUCTO DE LA GESTA UNO DE MADRE DE 16 AÑOS DE EDAD QUE LLEGA A LA SALA DE PARTO CON EMBARAZO DE 37 SDG, PRESENTA PROLAPSO DE CORDÓN UMBILICAL, ADEMÁS DE DILATACIÓN COMPLETA. SE OBTIENE NEONATO HIPOTÓNICO, SIN ESFUERZO RESPIRATORIO NI TONO MUSCULAR, SE DAN PASOS INICIALES SIN LOGRAR QUE PRESENTE ESFUERZO RESPIRATORIO ADECUADO, ADEMÁS DE PRESENTAR FRECUENCIA CARDIACA DE 80 LPM. SE CALIFICA CON APGAR 4 AL PRIMER MINUTO DE VIDA. SE EJECUTAN MANIOBRAS DE REANIMACIÓN NEONATAL Y SE LOGRA AUMENTAR LA FC, PERO SIN ADECUADO ESFUERZO RESPIRATORIO. ¿QUÉ ACCIÓN SE DEBE TOMAR DE INMEDIATO ANTE LA PRESENTACIÓN CLÍNICA DEL PACIENTE DURANTE EL PRIMER MINUTO DE VIDA',16,NULL),(53,'ATIENDE USTED UN NEONATO PRODUCTO DE LA GESTA UNO DE MADRE DE 16 AÑOS DE EDAD QUE LLEGA A LA SALA DE PARTO CON EMBARAZO DE 37 SDG, PRESENTA PROLAPSO DE CORDÓN UMBILICAL, ADEMÁS DE DILATACIÓN COMPLETA. SE OBTIENE NEONATO HIPOTÓNICO, SIN ESFUERZO RESPIRATORIO NI TONO MUSCULAR, SE DAN PASOS INICIALES SIN LOGRAR QUE PRESENTE ESFUERZO RESPIRATORIO ADECUADO, ADEMÁS DE PRESENTAR FRECUENCIA CARDIACA DE 80 LPM. SE CALIFICA CON APGAR 4 AL PRIMER MINUTO DE VIDA. SE EJECUTAN MANIOBRAS DE REANIMACIÓN NEONATAL Y SE LOGRA AUMENTAR LA FC, PERO SIN ADECUADO ESFUERZO RESPIRATORIO. ¿QUÉ AUXILIAR DIAGNÓSTICO SERÍA DE UTILIDAD INMEDIATA EN ESTE PACIENTE?',16,NULL),(54,'PACIENTE MASCULINO DE CUATRO MESES DE EDAD, PRODUCTO DE LA GESTA TRES DE TÉRMINO, SE OBTIENE POR EUTOCIA, DOBLE CIRCULAR A CUELLO, APGAR 7/9, PESO 3.100 KG, NEURODESARROLLO ANORMAL. INICIA CON CRISIS CONVULSIVAS AL DESPERTAR, CARACTERIZADAS POR GRITO PREVIO Y CONTRACCIÓN BREVE DE CUELLO, TRONCO Y MÚSCULOS DEL BRAZO, SEGUIDAS DE UNA FASE DE CONTRACCIÓN MUSCULAR SOSTENIDA DE DOS A 10 SEGUNDOS DE DURACIÓN, CON RELAJACIÓN POSTERIOR Y REPETICIÓN DE LA CONVULSIÓN. AL DÍA 12 EVENTOS DE LAS MISMAS CARACTERÍSTICAS.  EL ELECTROENCEFALOGRAMA SE CARACTERIZA POR ONDAS LENTAS DE ALTO VOLTAJE, PUNTAS Y POLIPUNTAS ACOMPAÑADAS DE DESORGANIZACIÓN DE FONDO, ACOMPAÑADO DE SUPRESIÓN DE DESCARGAS DURANTE EL SUEÑO. ¿CUÁL SINDROME EPILÉPTICO ES?',16,NULL),(55,'PACIENTE MASCULINO DE 82 AÑOS CON DIAGNÓSTICO DE HIPERTENSIÓN  ARTERIAL SISTÉMICA DESDE HACE 20 AÑOS.  ¿QUE CIFRA DE  PRESIÓN ARTERIAL ES LA MÁS ADECUADA PARA NUESTRO PACIENTE?',15,NULL),(56,'PACIENTE MASCULINO DE CUATRO MESES DE EDAD, PRODUCTO DE LA GESTA TRES DE TÉRMINO, SE OBTIENE POR EUTOCIA, DOBLE CIRCULAR A CUELLO, APGAR 7/9, PESO 3.100 KG, NEURODESARROLLO ANORMAL. INICIA CON CRISIS CONVULSIVAS AL DESPERTAR, CARACTERIZADAS POR GRITO PREVIO Y CONTRACCIÓN BREVE DE CUELLO, TRONCO Y MÚSCULOS DEL BRAZO, SEGUIDAS DE UNA FASE DE CONTRACCIÓN MUSCULAR SOSTENIDA DE DOS A 10 SEGUNDOS DE DURACIÓN, CON RELAJACIÓN POSTERIOR Y REPETICIÓN DE LA CONVULSIÓN. AL DÍA 12 EVENTOS DE LAS MISMAS CARACTERÍSTICAS. EL ELECTROENCEFALOGRAMA SE CARACTERIZA POR ONDAS LENTAS DE ALTO VOLTAJE, PUNTAS Y POLIPUNTAS ACOMPAÑADAS DE DESORGANIZACIÓN DE FONDO, ACOMPAÑADO DE SUPRESIÓN DE DESCARGAS DURANTE EL SUEÑO. ¿SEGÚN SU DIAGNÓSTICO, CUÁL ES LA TRIADA CARACTERÍSTICA DE ESTE TIPO DE SÍNDROME EPILÉPTICO?',16,NULL),(57,'NIÑO DE 5 ME