ER DE 35 AÑOS CON RIGIDEZ ARTICULAR Y DOLOR EN MANOS Y MUÑECAS DURANTE LOS ÚLTIMOS DOS MESES. SUS SÍNTOMAS SON MÁS SEVEROS POR LA MAÑANA Y MEJORAN POR LA TARDE. ELLA INFORMA UNA PERDIDA NO INTENCIONAL DE 5 KG, ASÍ COMO FATIGA. EF. HAY HINCHAZÓN Y SENSIBILIDAD EN LAS ARTICULACIONES METACARPOFALÁNGICAS E INTERFALÁNGICAS PROXIMALES. ¿ QUE ESTUDIO ES DE MAYOR UTILIDAD PARA REALIZAR EL DIAGNÓSTICO?',21,NULL),(69,'UNA MUJER DE 40 AÑOS CON LUPUS ERITEMATOS SISTÉMICO SE PRESENTA PARA LA EVALUACIÓN DE TROMBOSIS VENOSAS PROFUNDAS RECURRENTES. EL AÑO PASADA ELLA TUVO 5 EVENTOS. EN SU NUEVO INTERROGATORIO, SE REVELA UN HISTORIAL DE DOS ABORTO ESPONTÁNEOS CON MAS DE 10 SDG. EF NO SE ENCUENTRA NADA ESPECIAL. LAS PRUEBAS DE SANGRE REVELAN UN ANTICUERPO ANTINUCLEAR POSITIVO Y ANTICOAGULANTE LÚPICO. ¿QUE TRATAMIENTO ES EL MAS ADECUADO?',21,NULL),(70,'PACIENTE MASCULINO DE 69 AÑOS SIN ANTECDENTES MÉDICOS DE INTERES, PRESENTA UNA MONOARTRITIS AGUDA DE RODILLA. LA RADIOGRFÍA DE RODILLA MUESTRA UNA CALCIFICACIÓN DE AMBAS RODILLAS ¿CUAL DE LAS SIGUIENTES OPCIONES ES LA MAS RECOMENDADA PARA COMPLEMENTAR EL DIAGNÓSTICO DE LA ARTRITIS?',21,NULL),(71,'PACIENTE MASCULINO DE 32 AÑOS EL CUAL SE PRESENTA A CONSULTA CON DOLOR AGUDO DE DEDO GORDO DEL PIE DERECHO. EF SE ENCUENTRAN SIGNOS VITALES DENTRO DE PARAMETROS DE NORMALIDAD. SE ENCUENTRA ELAVACIÓN DE ACIDO URICO EN LOS ESTUDIOS DE LABORATORIO, SE COMIENZA EL TRATAMIENTO CON COLCHICINA ¿CUAL SE CREE QUE ES ES EL MECANISMO DE ACCIÓN DEL MEDICAMENTO UTILIZADO?',21,NULL),(72,'SE PRESENTA A CONSULTA PACIENTE MASCULINO DE 19 AÑOS POR 3 DÍAS DE MALESTAR GENERAL, ARTICULACIONES DOLOROSAS, INFLAMACIÓN NODULAR SOBRE SUS CODOS. EF. SE ENCUENTRA 38ºC DE TEMPERATURA Y UN RASH EN TRONCO Y HOMBRO IZQUIERDO. HACE DOS SEMANAS PRESENTO DOLOR DE GARGANTA Y FIEBRE. EN LOS ESTUDIOS DE LABORATORIO SE ENCUENTRA UNA PCR 34 MCG/L (ELEVADA). ¿QUE COMPLICACIÓN CARDIACA ES MAYORMENTE ASOCIADA A ESTA ENFERMEDAD?\n',15,NULL),(73,'USTED ATIENDE A PACIENTE FEMENINO DE 54 AÑ